INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(1, 'Maji Kyun! Renaissance', 'A cross media collaboration project between Sunrise & Broccolli.', 'https://www.igdb.com/games/maji-kyun-renaissance', '2016-09-21 00:00:00', 131913, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(2, 'Shinobi Blade', 'Shinobi Blade is an action-packed game, lets you play the role of a teenage ninja who sneaked out of the Dojo, before mastering all the ninja skills. You''ll learn what it is to truly be a ninja, be silent, agile and smart to outwit your opponents in 30 gorgeous missions. You need to be agile to avoid meat grinders/poison traps, street smart to solve puzzles/unlock gates. You possess skills such as jump, climb, deadly Katana slashes, lightning-fast shuriken to carve up hordes of gruesome monsters. Upgrade these great skills to overcome all dangers and challenges to complete all the missions. Final showdown with the demon bosses Charybdis, Minotaur and Vampire Kid to become the true master ninja demon slayer!!!', 'https://www.igdb.com/games/shinobi-blade', '2021-01-19 00:00:00', 147666, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(3, 'Hey Duggee: The Big Outdoor App', 'Welcome to the Big Outdoors, Squirrels! Introducing the latest app featuring Hey Duggee! Safe, ad-free fun for your little ones. \n \nCompleting each activity earns the Squirrel a badge. With 5 Squirrels playing for 7 badges each, that’s a whole lot of Duggee Hugs!', 'https://www.igdb.com/games/hey-duggee-the-big-outdoor-app', '2016-11-09 00:00:00', 88308, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(4, 'Soldier Front 2', 'A free-to-play multiplayer FPS currently in closed beta.', 'https://www.igdb.com/games/soldier-front-2', '2013-07-03 00:00:00', 63308, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(5, 'Blood Bowl 3: Black Orcs Edition', 'Fashion is not exactly a priority for Black Orcs… but intimidation, on the other hand, now we''re talking! Demand respect with the Black Orcs Edition. It includes customization Items for a Goblin, Troll and Black Orc.', 'https://www.igdb.com/games/blood-bowl-3-black-orcs-edition', '2023-02-23 00:00:00', 231577, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(6, 'Pet Puzzle', 'Pet Puzzle is a relaxing and leisurely three-in-a-row game.', 'https://www.igdb.com/games/pet-puzzle', '2019-06-08 00:00:00', 119025, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(7, 'The Ultimate FMV Bundle 2', 'Wales Interactive is proud to offer the ultimate bundle for their very best FMV games! Featuring Night Book, Who Pressed Mute on Uncle Marcus? Bloodshore, Five Dates and I Saw Black Clouds in one bundle!', 'https://www.igdb.com/games/the-ultimate-fmv-bundle-2', '2022-08-08 00:00:00', 213046, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(8, '19: Neunzehn', 'A strategy war game for the Famicom Disk System, released by Soft Pro International. It was never released outside of Japan.\n\nThe title of 19 is based on the Greek pantheon of Gods, of which there are nineteen. "Neunzehn" is simply the number 19 in German. The player controls one of four heirs with an equal claim to the throne of the Greek hero Achilles. The latter sends the four to procure a magical stone that confers omnipotence to the user, originally left behind by the Greek gods. Through warfare, the player-chosen hero must defeat the armies of their three rivals and claim it for themselves.', 'https://www.igdb.com/games/19-neunzehn', '1988-03-04 00:00:00', 41342, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(9, 'Road Doom', 'ROAD DOOM is an arcade bullet-hell with a cheesy story. You play as Road Warrior, the great mighty hero of the western lands. One day horrible beings invades your home, poking around trying to scavenge what they may find interesting. Road Warrior looses his temper, firing off his ultra mega lightning weapon of doom on the filthy beings. You become exhausted, weak, helpless... until your good buddy "Boat" arrives to re-supply your energy storage level! Determined, you move forward to push back the evil once and for all. A great quest lies ahead of you Road Warrior. Your determination and skill will be put to the test, as you fight against great beings of doom with powerful tricks. Save the world, defeat the Four Horsemen, charge!', 'https://www.igdb.com/games/road-doom', '2018-08-18 00:00:00', 108308, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(10, 'Meat & Greed', 'In the atmospheric puzzle-platformer Meat & Greed, you will experience the horrors of a slaughterhouse from the perspective of different animals. Solve riddles and collaborate with other animals to try and escape this ill-fated factory.', 'https://www.igdb.com/games/meat-and-greed', '2022-06-07 00:00:00', 203546, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(11, 'Shadow Wolf Mysteries: Cursed Wedding - Collector''s Edition', 'After being called to Paris, you find yourself in the middle of a shocking mystery involving an ancient werewolf hungry for revenge.', 'https://www.igdb.com/games/shadow-wolf-mysteries-cursed-wedding-collectors-edition', '2018-04-30 00:00:00', 99620, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(12, 'Hockey de Mesa', '', 'https://www.igdb.com/games/hockey-de-mesa', '2008-08-01 00:00:00', 230654, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(13, 'Dueling Network', 'Dueling Network (commonly abbreviated DN) was an online, unofficial Adobe Flash–based simulation of the Yu-Gi-Oh! Trading Card Game (TCG). It was created by Christopher Salvarani on March 3, 2006 and officially released on May 17, 2011. Its popularity grew quickly and it had gained more than four million registered users. The site was run by in-game volunteer administrators and moderators. At its peak, its server allowed for more than 10.000 players to be online at the same time.', 'https://www.igdb.com/games/dueling-network', '2011-12-31 00:00:00', 136180, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(14, 'Fishing Champion', '', 'https://www.igdb.com/games/fishing-champion', '1997-12-31 00:00:00', 200398, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(15, 'Little Squire''s Quests', 'Join Little Squire’s Quests to help our hero save the princess in the best pin rescue game. Your task is simple, just pull the pins, kill monsters, rescue the princess, collect treasure and complete the level. Sharpen your brain and improve intelligence by playing pull the pin puzzle game, you will always find it fascinating and engaging from start to finish. Many quests await you in our pull the pin game. Kill demons, kill spiders, pass lava, hunt for treasures, save the princess. Test your wits by solving 100’s of challenging brain puzzles. The beautiful princess and treasure chests are waiting for you to rescue and collect, let''s play now! What are you waiting for? quick go download now and play Little Squire’s Quests – and begin your journey of the best pull the pins game today!', 'https://www.igdb.com/games/little-squires-quests', '2021-01-19 00:00:00', 146778, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(16, 'Family Trainer: Extreme Challenge', 'Family Trainer: Extreme Challenge is the follow up to the successful Family Trainer game/mat bundle.', 'https://www.igdb.com/games/family-trainer-extreme-challenge', '2009-09-25 00:00:00', 85137, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(17, 'One Thousand Lies', 'One day, Ciaran Endyein reads a strange email, sent by an unkown person, who tells him to go to a certain park to retrive a certain object he bought.\nThis little action will change his life in a romantic comedy, with a really deep physcological background.\n\nIn the words of the mysterious Harry H: "if you want answers, go find her"', 'https://www.igdb.com/games/one-thousand-lies', '2016-04-21 00:00:00', 19444, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(18, 'LiMiT''s Escape Room Games', 'Escape Room Game with 2 levels with different difficulty', 'https://www.igdb.com/games/limits-escape-room-games', '2022-04-17 00:00:00', 196161, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(19, '10tons Adventure Puzzles Bundle', 'Sparkle 2: Sparkle 2 is a superbly polished marble shooter action puzzle game with beautiful graphics, mighty powerups and an amazing soundtrack. Match the orbs before they fall into the abyss and find your way through mysterious lands of startling beauty!\n\nAzkend 2: Step aboard a fantastic adventure! Enjoy amazing match-three gameplay and discover one of the most astonishing worlds ever imagined.', 'https://www.igdb.com/games/10tons-adventure-puzzles-bundle', '2016-11-25 00:00:00', 82461, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(20, 'Crazy Kong', '', 'https://www.igdb.com/games/crazy-kong--1', '1983-12-31 00:00:00', 130753, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(21, 'Voyager', 'A first person spacecraft shooter using polygon graphics.', 'https://www.igdb.com/games/voyager', '1989-12-31 00:00:00', 12930, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(22, 'Tower of Fortune', 'Tower of Fortune is a retro-style slot machine/RPG. You play as a retired hero and lived with daughter peacefully. Until one day, an unknown power from the mystic tower took her away. This force the hero to draw the sword again and fight for his daughter.', 'https://www.igdb.com/games/tower-of-fortune', '2012-04-30 00:00:00', 130751, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(23, 'Blood Bowl 3: Imperial Nobility Edition', 'The Emperor obviously expects his players to look very distinguished. Stand out from the rabble with the Imperial Nobility Edition. It includes customization Items for a Blitzer, Ogre and Thrower.', 'https://www.igdb.com/games/blood-bowl-3-imperial-nobility-edition', '2023-02-23 00:00:00', 239411, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(24, 'Mage Guard', 'Mage Guard is one of the world''s first truly gesture based spell casting games for VR. Take on the role of a Guild Mage, tasked with guarding the Guild’s most powerful relic, "The Grimoire".  Being the last of its kind, you will defend it against countless waves of enemies that are trying to obtain the precious relic. Use your Magic Powers to defeat those that oppose you. Level up and gain new spell abilities to aid you in intense spell casting combat.', 'https://www.igdb.com/games/mage-guard', '2017-07-31 00:00:00', 53308, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(25, 'The Lost Valley', '"The Lost Valley" is a small game where you will play as a cyclist who will get in an accident. The protagonist finds himself in a great valley called "The Lost Valley". The bicycle is broken as a result of cliff falling and the protagonist has to move further on foot. He must find out how to get out of the valley and reach the shore where he can find a boat.', 'https://www.igdb.com/games/the-lost-valley', '2015-04-20 00:00:00', 35429, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(26, 'Little Dungeon Stories', 'Little Dungeon Stories is a challenging roguelike card-based RPG. Enter the dungeon full of secrets, hostile monsters, deadly traps, and legendary loots. How long can you survive?', 'https://www.igdb.com/games/little-dungeon-stories', '2019-12-06 00:00:00', 118128, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(27, 'Video Hustler', 'A pool game initially released by Konami in 1981 for the arcade.', 'https://www.igdb.com/games/video-hustler', '1981-02-01 00:00:00', 38557, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(28, 'Dungeon Nightmares 1+2 Collection', 'The game is inspired by classic roguelike games which include 100% procedural-generated maps and permadeath. These features play an important part in making this game tense with the feeling of dread & terror as you walk the hallways of the dungeon. Every time you play, the dungeons are randomised which guarantees unlimited replay value. The game is simple. Get through each dungeon by surviving the horrors that lurk deep within and making your way to the exit. FEATURES - Dungeon Nightmares 1 Remastered - Dungeon Nightmares 2 : The Memory - Intense scary atmosphere - Combat-less gameplay - 100% procedural-generated maps - Permadeath - Rich 3D surround sound - Intelligent AI that changes based on the way you behave each night - Unlockable extras', 'https://www.igdb.com/games/dungeon-nightmares-1-plus-2-collection', '2021-01-18 00:00:00', 147142, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(29, 'Hidden Secrets: The Nightmare', '', 'https://www.igdb.com/games/hidden-secrets-the-nightmare', '2008-11-19 00:00:00', 209901, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(30, 'Gal Metal', 'Planet Earth is on the brink of invasion after humanity ruined the peace and quiet of the universe with the broadcast of metal music on the Voyager probe''s Golden Record. Aliens picked up the signal and couldn''t stop headbanging, and now they''re dying off because of it… so they want revenge!\n\nA few rogue extraterrestrials make their way to the source of the music and abduct two high school students from the Tokyo suburb of Kichijoji: an unnamed boy, and a drummer named Rinko from an outrageous girls-only metal club. The aliens needed an emissary with whom to discuss the terms of their revenge, and felt either of these two would serve nicely. However, being unable to choose between them, the aliens simply decided to merge their souls into a single being!\n\nNow, working together, the all-in-one pair must team up with the other members of K.M.G. (the Kichijoji Metal Girls) to rid the planet of these eight-tentacled extraterrestrials using the power of metal. It’s time to rock these music-hating creeps all the way back to whatever planet they came from!', 'https://www.igdb.com/games/gal-metal', '2018-02-08 00:00:00', 57142, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(31, 'Neon Arena', 'Neon Arena is a space arcade scoring arena game.', 'https://www.igdb.com/games/neon-arena--1', '2021-09-17 00:00:00', 171309, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(32, 'Asuka 120% Final Burning Fest.', 'Part of the Asuka 120% franchise of fighting games, "Final" adds minor changes to the original game, adding a "down" gauge and a new cast of voice actors.', 'https://www.igdb.com/games/asuka-120-percent-final-burning-fest', '1999-05-27 00:00:00', 77780, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(33, 'Rhom Bus', 'New, addictive and clever game mechanics in a beautiful and carefully designed world of rhombuses. Turn the tiles or turn the board to complete the levels and help the animals getting on the bus.', 'https://www.igdb.com/games/rhom-bus', '2017-02-22 00:00:00', 197231, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(34, 'Nurikabe by Nikoli', 'Nurikabe by Nikoli is a puzzle game for 3DSWare.', 'https://www.igdb.com/games/nurikabe-by-nikoli', '2012-10-11 00:00:00', 64556, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(35, 'Bismarck: The North Sea Chase', 'Germany''s massive dreadnought, Bismarck, sent Her Majesty''s Ship Hood to the bottom of the icy Atlantic on the evening of 24 May 1941. Of the Hood''s 1,415 crewmen, only 3 survived. \n \nBismarck''s guns are powerful enough to hurl automobile-sized shells for miles. With such awesome firepower, can she invincibly prowl the sea lanes? Can Britain stop her? \n \nBismarck- The North Sea Chase is a taut, multi-level game featuring full joystick control; real-time action; and variable speed and difficulty levels. You''re in charge of an exciting array of technical controls: Main Screen Map, Air Reconnaissance Screen, Weather Forecasting, Radar Search, Bridge Command and more! \n \nAnd when it''s time for action, you direct the anti-aircraft and heavy guns; launch torpedo attacks; and manage damage control! \n \nIf you tire of command from the bridge, you can pilot a Fairey Swordfish torpedo plane off a carrier flight deck. Hunt Bismarck from the air via this exciting, cockpit-perfect flight simulator. \n \nWith options to control either The Royal Navy or the infamous German battleship, Bismarck-The North Sea Chase provides an abundance of intriguing, sharp-edged game play.', 'https://www.igdb.com/games/bismarck-the-north-sea-chase', '1988-12-31 00:00:00', 14308, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(36, 'Need for Speed: The Run', 'Need for Speed: The Run lures players into an underground world of illicit, high-stakes racing. The heat is on - and it isn''t just the fuzz who are after you. Entering the race is just the beginning as you blow across borders, weave through dense urban traffic, rocket down icy mountain passes and navigate narrow canyons at breakneck speeds.', 'https://www.igdb.com/games/need-for-speed-the-run--1', '2011-11-18 00:00:00', 193780, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(37, 'Hidden Stroke: APRM', '', 'https://www.igdb.com/games/hidden-stroke-aprm', '2003-05-29 00:00:00', 209902, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(38, 'Yummy Girl 2', 'Sweet buns, ruddy cupcakes, juicy burgers - all these yummy girls love to eat. They are just waiting for you to feed them! ( ˘▽˘)っ♨', 'https://www.igdb.com/games/yummy-girl-2', '2022-04-08 00:00:00', 195243, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(39, 'Nanoworld', 'Sandbox game. Defend the planets from enemy minions.', 'https://www.igdb.com/games/nanoworld', '2019-11-15 00:00:00', 126369, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(40, 'A.E.', 'A.E. is a Space Invaders inspired game with a 3D view. In A.E. the earth is under attack by swarms of aliens who drop bomb after bomb and it''s your job to defend planet Earth. You control a laser cannon that moves horizontally at the bottom of the screen. To earn point you should shoot all the alien forces before they shoot you! The game becomes more challenging when you progress in the game as the alien swarm splits up and attack you from several sides. This version is a homebrew version released in 2012', 'https://www.igdb.com/games/ae--3', '2012-12-31 00:00:00', 283003, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(41, 'Depth of Extinction', 'THE SEAS HAVE RISEN A cataclysmic event has forced humanity to build undersea environments to survive. Now 500 years have passed and we are in decline. Pirates, raiders, androids and worse things scour what is left of these habitats looking to survive. Find cover and attack enemies but be careful because every move is critical if you want to keep your team alive.', 'https://www.igdb.com/games/depth-of-extinction', '2020-06-03 00:00:00', 55543, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(42, 'Shape Shifter', 'Far below the three moons that hang in the midnight sky lies the land of Krelion. And the people of this land live in an age of perfect peace and prosperity known as the Age of Light, a time by a band of powerful wizards known as the Ring of Five.\n\nBut, on the 11th moon of the Age of Light, a dark wave of evil has begun to sweep across the land, leaving a wide path of destructing in its wake. And the Ring of Five, which has protected Krelion for centuries untold has suddenly vanished from the land. Their fate is left in the unholy hands of three evil beings from the shadow realm known as the Dark Ones.\n\nNow the mid-summer equinox is almost at hand. And with this event, the Dark Ones will shatter the barrier that lies between Krelion and the shadow realm. But there is a single light in the darkness. His name is Lykas and he has the power to change his shape at will. Hopefully, he can save Krelion before it is too late ... before the land is plunged into a dark, eternal nightmare... never to awaken...', 'https://www.igdb.com/games/shape-shifter', '1992-12-31 00:00:00', 44308, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(43, 'Carriers at War', 'Naval wargame. This is the second remake of the 1984 Carriers at War. It is based on World War II naval warfare and focuses on the Pacific Theater.\n\nThis remake contains 7 scenarios based on the historical battles. Every scenario has at least one non-historical course of action.', 'https://www.igdb.com/games/carriers-at-war', '2007-06-08 00:00:00', 71213, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(44, 'Chill Out', 'Chill Out is the fourteenth game in the NES version of Action 52.\n\nOld man winter is at the top and is your goal, but it keeps snowing and he''s blowing. You must reach the top before you get snowed under.', 'https://www.igdb.com/games/chill-out--2', '1991-09-01 00:00:00', 245072, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(45, 'Jewel Master: Cradle of Athena', 'It''s a match 3 puzzle game', 'https://www.igdb.com/games/jewel-master-cradle-of-athena', '2010-10-28 00:00:00', 24365, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(46, 'Landon', 'Everyone lives in an utopia, because science makes huge leaps in every area. But Landon, he''s not happy. He''s not getting the enjoyment he wants, so he tries to get some.', 'https://www.igdb.com/games/landon', '2017-10-13 00:00:00', 55648, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(47, 'Clue Jr. SpyGlass Mysteries', '', 'https://www.igdb.com/games/clue-jr-spyglass-mysteries', '1999-12-31 00:00:00', 206978, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(48, 'Malevolence', 'Malevolence is a 9 map single player Boom Compatible episode tested in PrBoom+. It features extensive dehacked changes to enemies and weapons. It pits you against an evil SuperAI and its cyborg army as you try to shut down Malevolence before Earth gets converted into cyborg central.', 'https://www.igdb.com/games/malevolence--1', '2022-08-27 00:00:00', 269457, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(49, 'The Final Prize is Soup', 'Survival-horror yuri visual novel.\n\nAfter a disastrous break up, Qian Hailu wakes up to find that she''s dead. Luckily (or unluckily), she''s been given a chance to turn back the clock and avert her death—as long as she can pass three rounds in the game of life.', 'https://www.igdb.com/games/the-final-prize-is-soup', '2023-10-02 00:00:00', 270442, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(50, 'Five Days', '', 'https://www.igdb.com/games/five-days', '2002-12-31 00:00:00', 287510, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(51, 'Magic Princess - Girls Makeup & Dressup Salon Game', 'This is the fully unlocked version and it does not have advertisements! \n\nWelcome to a kingdom in a magical land filled with radiant colors! \nHere you''ll meet a friendly princess who can''t wait to have you as her guest. Like any girl, she loves being pampered at the spa, putting on pretty makeup and dressing up in beautiful outfits.\nToday you can help her look beautiful, just as her kingdom expects her to be.\n\nFeatures of this game:\n* 3 princesses: Harmony, Celine and Eva\n* 3 beautiful game sections: facial spa, makeup salon and dress up\n* Many sparkly dresses, capes and matching shoes\n* Select one of 10 magical unicorns and horses to stay beside your princess\n* Choose from 5 butterflies that will fly around your princess after dressing her\n* 3 vibrant fairy tale backgrounds to choose from after dressing her\n\nHow to play this game:\nSelect your favorite princess: Harmony, Celine or Eva. She''ll meet you at the royal spa inside her colorful castle. Here you will give her a soothing facial using magic ingredients that help keep her skin looking perfect.\nThen you''ll go to the beauty salon where you will be able to apply pretty makeup to her face. The shimmery eye shadows will surely play up the the beautiful color in her eyes. And of course, how can you forget the jewelry? Sparkling diamond earrings and necklaces that go along with her princess tiara!\nNext is her dressing room which is filled with so many fancy dresses and capes. With all those beautiful choices, you won''t go wrong. Any combination will captivate her kingdom!\nOf course, being a magical land, there are majestic unicorns and horses. And you''ll get to choose the one to accompany her today!\n\nToday you will experience the magic of this colorful land by playing this fairy tale makeover game!', 'https://www.igdb.com/games/magic-princess-girls-makeup-and-dressup-salon-game', '2015-12-19 00:00:00', 87465, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(52, 'Super Strike Eagle', 'Microprose''s F-15 Strike Eagle series returns with an edition for the Super Nintendo. Super Strike Eagle puts you in the cockpit of an F-15 as you attempt to force various governments back into the United Nations.\n\nTo accomplish this, players must bomb targets, shoot down enemy fighters, and sink ships. Gameplay takes place in both the first-person and third-person perspectives.', 'https://www.igdb.com/games/super-strike-eagle', '1993-02-01 00:00:00', 42449, NULL);
