INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(61, 'Tamagotchi Meets: Sweets ver.', 'The Tamagotchi Meets: Sweets version was released in Japan in November 2019. It features two new locations and seven new and returning characters: Dolce Town (Amamelotchi, Himedolcetchi, Hotcaketchi, and Patitchi) and Wagashi Village (Himeamachatchi, Tsubuanonetchi, and Wagassiertchi).', 'https://www.igdb.com/games/tamagotchi-meets-sweets-ver', '2019-12-31 00:00:00', 230048, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(62, 'Hoyle Casino 2009', '', 'https://www.igdb.com/games/hoyle-casino-2009', '2008-12-31 00:00:00', 210066, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(63, 'Adagio', 'A short VR experience, Adagio places the viewer in a dreamy, Celtic landscape in the brief moment of darkness right before dawn. Are they alone or accompanied? Some say that as dawn breaks, you can witness ghosts tasting the morning dew.', 'https://www.igdb.com/games/adagio', '2019-05-23 00:00:00', 93231, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(64, 'Brigand: Oaxaca', 'Brigand: Oaxaca is a highly difficult post-apocalyptic RPG/FPS set in Mexico. The story will take you from a banana plantation to dark toxic caverns, to the sprawling city of Pochutla, to the flooded coastline, to deadly demon-infested jungles, and more. There are 14 unique skills to upgrade with skill points, ranging from agility to firearms, hacking, hardware, voodoo, and more. Unlock up to 80 special abilities that allow you to do things such as throw your weapon, upgrade your guns, and even control the weather. Dangers include rival tribes fighting for fertile land, mutated ghouls that emerge from their caverns at night, vicious demons that hunger for your flesh, a flooded and irradiated coastline that eats away at civilization, disease, insanity, hunger, and more. You will die often, and you will like it.  \n  \n#indiegame, #fps, #rpg, #survivial, #horror, #mexico', 'https://www.igdb.com/games/brigand-oaxaca', '2017-07-11 00:00:00', 28045, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(65, 'The Purification', 'As the last surviver you find yourself in a zombie infected wolrd. Survive by finding weapons and objects to escape the horror.', 'https://www.igdb.com/games/the-purification', '2020-11-20 00:00:00', 164892, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(66, 'King''s Quest III Redux: To Heir is Human', 'King’s Quest III: To Heir is Human is a remake of the classic third installment of the King’s Quest series by Roberta Williams. It has been translated from its original EGA 16-color graphics into the style of Sierra’s VGA graphics of the early 1990’s by Infamous Adventures, a group of fans devoted to remembering classic adventures.', 'https://www.igdb.com/games/kings-quest-iii-redux-to-heir-is-human', '2011-01-20 00:00:00', 132066, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(67, 'Brick Breaker Star: Space King', 'Brick Breaker game that everyone can enjoy. Enjoy various missions and addictively simple play control.', 'https://www.igdb.com/games/brick-breaker-star-space-king', '2016-12-31 00:00:00', 234955, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(68, 'Hero Siege: Gates of Valhalla', 'Features Act 8 Expansion and its content', 'https://www.igdb.com/games/hero-siege-gates-of-valhalla', '2022-06-14 00:00:00', 204957, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(69, 'Nodrog''s Fortress', 'Nodrog''s Fortress is a Tactics-like Turn-Based All at Once Battler that features elements of Chess and American Football in a JRPG inspired package. Choose your Archmage, companions to fight for them, and try your hand in the 9 Story Missions, Local Pass and Play, PVP Online or in Survival mode, where there is no true Victory...', 'https://www.igdb.com/games/nodrogs-fortress', '2022-10-30 00:00:00', 182463, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(70, 'Super Sketch', 'The game cartridge used for the ColecoVision''s Super Sketch drawing tablet accessory.', 'https://www.igdb.com/games/super-sketch', '1984-12-31 00:00:00', 283010, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(71, 'Tap Tap Arcade 2', 'Another compilation of RCMADIAX games, this time with an exclusive game, Volcano, bundled within.', 'https://www.igdb.com/games/tap-tap-arcade-2', '2016-07-07 00:00:00', 58376, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(72, 'The Empress of Mahjong', 'The Empress invites you to play! Immerse yourself in the amazingly beautiful locations of Asia and complete mahjong levels approved by the Empress herself!', 'https://www.igdb.com/games/the-empress-of-mahjong', '2023-05-11 00:00:00', 249471, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(73, 'Naruto Shippuden: Ninja Council 4', 'Set two and a half years after the events of the classic Naruto series, Naruto fans are introduced to older characters as the storyline advances and unfolds with copious plot twists. Naruto Shippuden: Ninja Council 4 also allows gamers to follow an older Naruto and his friends on the quest to save Gaara from the sinister Akatsuki organization. Players are able to choose their allies and form a three-man squad with special jutsu techniques to ward off looming danger. Dedicated franchise fans and new Naruto fighters alike can utilize the touch screen to unleash their unique jutsu attacks and take on anyone that gets in their way. As an added bonus, unlockable jutsu allow aspiring ninja to explore previously unreachable areas.', 'https://www.igdb.com/games/naruto-shippuden-ninja-council-4', '2009-06-02 00:00:00', 21122, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(74, 'Sleeping Dogs: Wheels of Fury', 'The Wheels of Fury Pack gives you full control of the ultimate prototype supercar to tear up Hong Kong - the DZS-90. Uncover the story of Dr. Tang’s secret prototype across 5 all-new missions - each time adding incredible upgrades to the vehicle. The DZS-90 in its final form includes twin, concealed roof-mounted machine guns, 4-wheel steering, an electronic magnetic pulse, boosted speed and armor, and new styling options to show it off.', 'https://www.igdb.com/games/sleeping-dogs-wheels-of-fury', '2013-02-26 00:00:00', 78449, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(75, 'Datura', 'Explore the haunting world of Datura and embark on a voyage of mystery.', 'https://www.igdb.com/games/datura', '2012-05-08 00:00:00', 14527, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(76, 'Fishy2', '150 levels total! through 10 worlds start from beginner levels, advance levels or expert levels.', 'https://www.igdb.com/games/fishy2', '2020-01-28 00:00:00', 129381, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(77, 'Top Bike: Racing & Moto Drag', 'Top Bike: Racing & Moto Drag will take you out into a world full of criminals and dangerous races!\nSeparated into a set of districts, each with its own look and really feel. Prepare for heart-stopping and breathtaking thrills you have never seen in games before. Feel the adrenaline overload as you start racing against the biker gangs that rule The City.', 'https://www.igdb.com/games/top-bike-racing-and-moto-drag', '2022-01-17 00:00:00', 187455, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(78, 'Go! Go! Hypergrind', 'Go! Go! Hypergrind is a skateboarding video game for the Nintendo GameCube that was developed by Poponchi and published by Atlus Co. Animation studio Spümcø of Ren & Stimpy fame contributed character designs and animations to the game.', 'https://www.igdb.com/games/go-go-hypergrind', '2003-11-18 00:00:00', 3933, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(79, 'Into the Inferno', 'A retro-style first-person dungeon crawler RPG where you rescue kidnapped children from an underground demon horde.\n\nLead a party of four adventurers through the wilderness, a hostile Orc village, a town of violent Gnolls, and many levels of winding caverns and burning brimstone tunnels. Gather experience and equipment to improve your chances of defeating the demon horde to rescue the children and return them home where they belong. Help recover the remains of the lost miners to give their families closure, and eliminate the demon threat once and for all.', 'https://www.igdb.com/games/into-the-inferno', '2023-10-17 00:00:00', 258629, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(80, 'Warlander', 'Warlander is an action-packed, third-person, online-multiplayer game, with a unique style that mashes a Medieval-inspired setting, Fantastical items and abilities…and…even powerful robots!\n\nFeaturing intense competitive skirmishes and epic castle siege warfare with up to 100 players, you must use the almighty powers of god-like Warriors, Clerics, and Mages, as well as siege weapons and cataclysmic spells to control the battlefield.\n\nTo be victorious, you must work as a team, defend your Keep, and tactically break into the enemy’s stronghold to destroy their core!', 'https://www.igdb.com/games/warlander--1', '2023-05-16 00:00:00', 215835, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(81, 'Hyperspace Delivery Boy!', 'You are Guy Carrington, lowly Courier-in-Training on the HDS Colby Jack. Your job: delivery mail and packages to the most dangerous parts of the galaxy! Can you make Courier 1st Class? Can you win the heart of your secret love, Chief Engineer Dolly? Can you face THIRTY levels of dangerous puzzles and insane inhabitants?', 'https://www.igdb.com/games/hyperspace-delivery-boy', '2001-12-23 00:00:00', 69016, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(82, 'Dragon''s Lair', 'A homebrew port of the Coleco Adam Dragon''s Lair game to the Colecovision\n\nAll the action of the arcade game in your living room! This special adaptation brings home all the excitement of the legendary arcade game and gives you even more control over the action! Lead Dirk the Daring on his quest to rescue beautiful Princess Daphne, who''s been imprisoned in a crystal ball by the evil dragon. To complete this noble mission, you''ll need courage and quick reflexes! Fend off supernatural forces with your sword or use your wits to escape. Swing on a rope over fiery chasms. Fight fierce battles with the dreaded Phantom Knight and cunning rat guards. Find a way to survive and you''ll take on the most deadly foe of all, the diabolical dragon himself!', 'https://www.igdb.com/games/dragons-lair--8', '2012-12-31 00:00:00', 283008, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(83, 'Slam!', 'Slam! is a Windows-based (3.x) simulation of the popular table game of air hockey. Players can customize opponents skills with the ability to change aggressiveness and quickness from 1 to 99, change view angle from zero to 90 degrees, turn sound on/off and have a choice of default color or monochrome default (black and white) coloring. You control your paddle with the mouse, and by right clicking players can enter the options menus.', 'https://www.igdb.com/games/slam--1', '1993-01-01 00:00:00', 94696, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(84, 'Samurai Slash', 'Samurai Slash is runner in Japanese style! Run, collect the power and gold, slash your enemies with two katanas, and finally fight with big boss.', 'https://www.igdb.com/games/samurai-slash', '2021-10-30 00:00:00', 254326, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(85, 'Heartomics: Nokori', 'Heartomics: Nokori is a game where you raise a hero then you go explore with said hero.', 'https://www.igdb.com/games/heartomics-nokori', '2016-03-25 00:00:00', 33152, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(86, 'All is Fair in Love and Vore: The Tavorion Collection', 'Vore visual novel! Vore! Sex! Complex characters! Profound thoughts! Women! Well-researched historical settings! Cannibalism! Never before has it been so easy to play all 6 iconic masterpieces, now with extra content!', 'https://www.igdb.com/games/all-is-fair-in-love-and-vore-the-tavorion-collection', '2023-05-30 00:00:00', 250600, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(87, 'Play Dog Play Tag', 'Dogs are very clever and brave creatures. It sometimes surpasses the owner and they can be said to be the best partners for humans.', 'https://www.igdb.com/games/play-dog-play-tag', '2019-09-06 00:00:00', 119271, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(88, 'Chex Quest 4: Flemmed to The Core', 'A modification of Chex Quest 3 that adds a new episode.', 'https://www.igdb.com/games/chex-quest-4-flemmed-to-the-core', '2020-03-07 00:00:00', 252535, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(89, 'Sowon', 'In the middle of the night, while finding her parents, a girl falls to the toy world through attic locked for a long time. Will it be possible for her to find her parents and go back to her world? Let''s solve some puzzles and explore the mysterious toy world.', 'https://www.igdb.com/games/sowon', '2022-10-28 00:00:00', 222984, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(90, 'Shikinjoh', 'Shi-Kin-Joh ("Forbidden City") is a puzzle game similar to Sokoban in which the player must reach a goal by pushing oversized mahjong tiles which block the path. When two matching tiles are pushed next to each other, they disappear. Other types of tiles will lock any movable tiles that come in contact with them.\n\nThe Megadrive version includes five different sound & graphics sets, dozens of puzzles to solve, and a "special puzzle" mode where the rules of the game are changed dramatically. There is also a puzzle construction mode where custom puzzles can be created. Game progress is saved using passwords.', 'https://www.igdb.com/games/shikinjoh--1', '1991-07-16 00:00:00', 231545, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(91, 'SimAnt', 'SimAnt is a simulation strategy game which makes you a head of ant colony. There are 3 ways to play SimAnt: Quick Games, Full Games, and Experimental games.\nIn Quick Games you are a black ant colony competing with a red ant colony for food and territory. Your goal is to defeat the red ants and take over your home turf - the local patch of ground in the backyard. Your task will be complicated by marauding spiders, voracious ant lions, torrential rains, crusing human feet and merciless lawn mowers.\n\nIn Full Games you must take over the entire backyard section by section. Then take over the house and drive out the humans. In addition to hordes of red ants and other pests, you will face the chemical death of inescticides\n\nIn Experimental Games, you are a human playing and experimenting with ants. Your tools let you build walls and barriers to run ants through mazes, add food, add ants, dig of fill in holes, test ants'' reactions to various trail marking and alarm chemicals, and play with insecticide.', 'https://www.igdb.com/games/simant', '1991-12-31 00:00:00', 9520, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(92, 'V-Rally: Championship Edition', 'Game Boy port of V-Rally: Championship Edition.', 'https://www.igdb.com/games/v-rally-championship-edition--1', '1998-08-08 00:00:00', 152047, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(93, 'Samurai Spirits Sen', '', 'https://www.igdb.com/games/samurai-spirits-sen', '2009-12-10 00:00:00', 7172, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(94, 'Thomaz', 'Our princess has been kidnapped by a demonic wizard. Mike is not the first one who tries to save her; but he will be the last! Play against the enemies which getting harder each level, and defeat the wizard to get the princess.', 'https://www.igdb.com/games/thomaz', '2017-07-10 00:00:00', 44244, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(95, 'Self', 'self is lost without soul', 'https://www.igdb.com/games/self--1', '2021-02-21 00:00:00', 177635, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(96, 'Renegade Grounds: Episode 1', 'First episode of a thrilling adventure! Two mercenaries, Agela and Ingus, are tasked to infiltrate the criminal underworld to retrieve a device of high value that was stolen from the council. The job gets more complex as more factions join the hunt for the item, but to Agela and Ingus, failure is not an option!', 'https://www.igdb.com/games/renegade-grounds-episode-1', '2017-08-31 00:00:00', 55508, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(97, 'Jigsaw Fun: Greatest Cities', 'Solve 100 jigsaw puzzles of Greatest Cities. Puzzle solo or together in multiplayer for up to 4 players!', 'https://www.igdb.com/games/jigsaw-fun-greatest-cities', '2021-12-23 00:00:00', 187092, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(98, 'Gold Is Mine', 'A gold hunter simulator. Here you can walk around the forest and enjoy the nature, meet different animals and, of course, gather gold.', 'https://www.igdb.com/games/gold-is-mine', '2021-03-04 00:00:00', 148842, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(99, 'Broccoli Bob', '"Broccoli Bob" is an adventure game that combined with puzzle.', 'https://www.igdb.com/games/broccoli-bob', '2017-03-22 00:00:00', 29244, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(100, 'Exhibition of Speed', 'Looking for high-speed authentic arcade action? Strap yourself firmly in for this electrifying new racing game. Extensive game features include over twenty world-class racing vehicles including hidden cars, fifteen challenging tracks with varying weather conditions in five different universes, spectacular car jumps with additional boosters on the track, stunning visual SFX on the landscapes and multiplayer gaming for up to four players.', 'https://www.igdb.com/games/exhibition-of-speed', '2001-06-18 00:00:00', 46365, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(101, 'Synth Pong', 'Synth Pong is a twist on the classic Pong game and is perfect for anyone who loves the 80''s synthwave aesthetic. You can challenge your friends in intense PvP sessions or enjoy the game solo in story mode, as well as a series of levels and challenges.', 'https://www.igdb.com/games/synth-pong', '2023-06-13 00:00:00', 235759, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(102, 'Tony Hawk''s Downhill Jam', 'In Tony Hawk’s Downhill Jam, Tony travels to 6 far away locations to challenge each venue’s top downhill racer in a quest to add them to the team. The goal is to make it to the bottom of the hill with the best time! You will also be asked to complete other challenges as well.\n\nThe DS version supports up to 4-player Wi-Fi internet and local wireless play. There are over 20 online game modes to choose from. The game also supports voice chat with people on your friends list. This game also has a community website (ds.downhill-jam.com) where users can upload their high scores, bests runs and chat with other skaters.', 'https://www.igdb.com/games/tony-hawks-downhill-jam', '2006-10-24 00:00:00', 210449, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(103, 'Flif', 'Baby angels save the world from drought! Bonky glidey flappy physics platforming! Explore clouds & sky ruins & collect raindrops!\n\nCommissioned for Indiepocalypse #38.', 'https://www.igdb.com/games/flif', '2023-03-03 00:00:00', 251294, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(104, 'Final Fantasy Explorers-Force', 'A mobile RPG with up to 5 player co-op set in the Final Fantasy universe.\nYou can choose between classes common to the Final Fantasy series and temporarily transform into famous characters from Final Fantasy games to take on the summoned beasts rampaging throughout the world.', 'https://www.igdb.com/games/final-fantasy-explorers-force', '2018-03-15 00:00:00', 27410, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(105, 'Oil Enterprise', 'In Oil Enterprise, you enter the multi-million dollar business of black gold as a shrewd businessman. Accept the challenge and grow from a small-scale en-trepreneur, investing in your first oilfield, to a global oil magnate.', 'https://www.igdb.com/games/oil-enterprise', '2016-04-20 00:00:00', 24520, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(106, 'Forbidden Fruit', 'Gather all the fruit, in a specific order, and then the key which will allow you to unlock the door to the next level. Movement of foes is very predictable as they move in a circular fashion, allowing you to easily move around them.', 'https://www.igdb.com/games/forbidden-fruit', '1985-02-01 00:00:00', 47527, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(107, 'Swarog', 'Swarog is an unique real-time strategy game set in ancient Russia. There is the story of a violent Pagan God and the people he leads to victory over their enemies. In a series of missions your leadership ability is put to the test and you have to gather food, wood and ore in order to take care of your peasants. Then tax them as you need to raise an army to protect your subjects from attack by the vicious invasion forces that threaten your borders. You can choose from the two scenarios, ones for Kranks or Luzhevyans. Each mission consists of several levels, each level has its own major task to accomplish in order to achieve victory.', 'https://www.igdb.com/games/swarog', '1999-12-31 00:00:00', 92950, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(108, 'Tiger Tank 59 I: A-Gun MP017', '"Tiger Tank 59" is a top-down shooting game. Players need to control their tanks, through the enemy lines, break the enemy base, or defeat the enemy tanks. This DLC contains the Map No.101-105.', 'https://www.igdb.com/games/tiger-tank-59-i-a-gun-mp017', '2021-06-24 00:00:00', 160922, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(109, 'Turntablist: DJ Battle', 'Turntablist: DJ Battle is an Action game, developed and published by Bandai, which was released in Japan in 1999.', 'https://www.igdb.com/games/turntablist-dj-battle', '1999-12-25 00:00:00', 37527, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(110, 'LittleBigPlanet: Metal Gear Solid Level Kit', 'Create your own homage to Metal Gear Solid with this action-packed Level Kit. Included are some additional gameplay features like the messy Paintinator gun, a Paint Switch and five themed Metal Gear Solid levels. Also on offer are loads of new stickers, decorations and a new Gurlokovich Soldier costume!', 'https://www.igdb.com/games/littlebigplanet-metal-gear-solid-level-kit', '2008-12-24 00:00:00', 194520, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(111, 'Bloody Woman', 'A young man accepts a job in a laundry in the late hours. But he discovers that something terrible has happened there and his life is in danger.', 'https://www.igdb.com/games/bloody-woman', '2023-05-02 00:00:00', 252539, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(112, 'Into the Dungeon', 'Explore Dungeons, Solve Puzzles, Fight Monsters and collect some Loot!', 'https://www.igdb.com/games/into-the-dungeon', '2022-05-15 00:00:00', 201939, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(113, 'Axel in Harlem: The Game', 'You''re the chosen one to help him gather homies for... his "night parties". Guide him to victory before the time runs out!', 'https://www.igdb.com/games/axel-in-harlem-the-game', '2023-04-03 00:00:00', 250132, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(114, 'FIFA 16', 'Mobile port of FIFA 16.', 'https://www.igdb.com/games/fifa-16--2', '2015-09-22 00:00:00', 240449, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(115, 'Tak and the Power of Juju', '', 'https://www.igdb.com/games/tak-and-the-power-of-juju--1', '2003-10-15 00:00:00', 248449, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(116, 'Age of Empires II: Gold Edition', 'Age of Empires II Gold Edition unites the exciting game play of both Microsoft Age of Empires II: The Age of Kings and Age of Empires II: The Conquerors Expansion - plus additional content - for one compelling gaming experience. Age of Empires II: The Age of Kings spans 1,000 years, from the fall of Rome through the Middle Ages, in which players control the destiny of one of thirteen civilizations. Age of Empires II: The Conquerors Expansion will challenge veterans and novices to wage war on an epic scale with all-new civilizations, unique units and technologies, and campaigns based on infamous conquerors such as Attila the Hun, El Cid and Montezuma.\n\nAge of Empires 2 Gold Edition unites the exciting game play of both Age of Empires 2: The Age of Kings and Age of Empires2: The Conquerors Expansion plus additional content for one compelling gaming experience. Experience real-time evolution as you build your civilization into a flourishing empire, from the Dark Age to the Imperial Age. Decide whether to conquer the world through military might, commerce and diplomacy, or intrigue and regicide. There are many paths to power but only one will reign supreme. Age of Empires 2: The Age of Kings spans 1,000 years, from the fall of Rome through the Middle Ages. Players control the destiny of one of 13 civilizations. The game keeps the epic scope of Age of Empires'' gameplay while evolving the combat and economic features. Developed by Ensemble Studios, Age of Empires 2features the expertise of Bruce Shelley, co designer of Age of Empires and the hit strategy game Civilization. Age of Empires 2: The Conquerors Expansion adds five new civilizations, four new campaigns, 11 new units, 26 new technologies, real world maps, and much more. Experience the adventure of the Spanish Conquistadors as they enter the exotic lands of the Aztecs, or relive the destructive force of Attila''s pillaging Huns. This add-on pack focuses on the armies and military thinking of a handful of history''s greatest tacticians, including Attila the Hun, El Cid, and Montezuma. The new civilizations each have unique attributes, buildings, and technologies, such as Chinese Rocketry and Persian Mahouts. You''ll put hussar cavalry, kamikaze siege units, and halberdier infantry into battle in four all-new campaigns. Play up to eight other conquerors via modem, Internet, or LAN.', 'https://www.igdb.com/games/age-of-empires-ii-gold-edition', '2002-05-12 00:00:00', 129797, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(117, 'Interrogation Files: Port Landsend', 'Interrogation Files: Port Landsend is a FMV game where you have to search through police interrogation footages of suspects of a crime, the goal is to find the murderer to assist to his arrest and judgment.', 'https://www.igdb.com/games/interrogation-files-port-landsend', '2020-06-19 00:00:00', 137214, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(118, 'Endless Days II', 'After some lighthouse keepers mysteriously disappear, Matthews, a police detective, goes to the island to investigate and find out what''s going on.\n\nHe agrees to look after the lighthouse for six months while he investigates the island... But something terrible is about to unfold...', 'https://www.igdb.com/games/endless-days-ii', '2023-04-13 00:00:00', 252538, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(119, 'SD Gundam: Operation U.C.', 'Operation U.C. is a scrolling shooter. Take control of the original, Zeta, or ZZ Gundam and fight against their respective rivals.', 'https://www.igdb.com/games/sd-gundam-operation-uc', '2002-02-16 00:00:00', 66590, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(120, 'Kantai Collection', 'Kantai Collection is a Japanese free-to-play web browser game. The gameplay is centered upon building squadrons composed of individual characters represented as cards with different attributes, and then sending said squadrons out on missions. Each of the characters are moe anthropomorphisms of World War II naval warships which are depicted as cute girls, known as "Fleet girls". These personified warships are based on real-life vessels which are explained in detail within the game; the physical characteristics, appearances and personalities of each of the girls correlate in some way to the real-life vessel (for example, ships with a larger displacement tonnage are usually depicted as older girls with more mature bodies, while smaller ships have petite and underdeveloped figures, with a few exceptions). The player takes on the role of an admiral and organizes their fleets in battle in order to win. Combat is largely automated, and manual actions by the player include micromanagement such as building and repairing.', 'https://www.igdb.com/games/kantai-collection', '2013-04-23 00:00:00', 12737, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(121, 'Girp', 'A spiritual successor of sorts to the developer''s earlier QWOP, this one takes the physical feats out of the realm of organized sport and instead puts the player in control of a man desperately clinging to a rocky oceanside cliff at sea level. Numerous handholds are available with which to pull himself up, helpfully labeled with keyboard letters, and if a handhold proves out of reach the player can activate a muscle-tensing big push, really striving to get close enough to the handhold to grab it. The player''s body is governed by ragdoll physics, meaning that sometimes some rocking or swinging motions are needed in order to get close enough to make use of a handhold. Additional challenge is provided by shore birds who have made their nests in the handholds, obscuring the relevant letter with their feathery little bodies, plus of course the gradually-rising tide.', 'https://www.igdb.com/games/girp', '2011-03-28 00:00:00', 137545, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(122, 'Raging Tiger: The Second Korean War', 'Raging Tiger: The Second Korean War is an extremely complicated strategy game from ProSIM Company and Shrapnel Games.', 'https://www.igdb.com/games/raging-tiger-the-second-korean-war', '2004-08-16 00:00:00', 63473, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(123, 'Topsoil', 'Your goal is to harvest as many plants as you can before your garden fills up! Manage your garden by placing plants of the same type next to each other, then harvesting them together.', 'https://www.igdb.com/games/topsoil--1', '2017-04-26 00:00:00', 142590, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(124, 'Research and Development', 'Research and Development is a puzzle-centric mod for Half-Life 2: Episode Two featuring an unarmed player but plenty of violent mayhem.', 'https://www.igdb.com/games/research-and-development', '2009-07-17 00:00:00', 182643, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(125, 'The Wanderer', 'The Wanderer is an immersive, narrative-driven game with a focus on atmosphere. You play as a little robot, wandering through the end of the world. Will you too fade into memory? Only you can uncover secrets long kept hidden and take control of fate. Enjoy The Wanderer!', 'https://www.igdb.com/games/the-wanderer--1', '2021-11-30 00:00:00', 193161, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(126, 'Steel Salvo', 'Pilot a hulking mech and protect Triton from robot hordes. With the help of your team, vanquish the robot overlord!  \nExperience super-fast FPS mecha action in this short but challenging single-player game!', 'https://www.igdb.com/games/steel-salvo', '2021-04-07 00:00:00', 145545, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(127, 'Paradise Sickness', 'Large Egyptian level with an archeological research base built into a tomb below a pyramid. The map features several popcultural references and the map source is included.', 'https://www.igdb.com/games/paradise-sickness', '2017-09-23 00:00:00', 270769, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(128, 'Grim Legends 3: The Dark City', 'Don the mantle of a relentless monster huntress in a crumbling city in need of redemption! When the powerful artifact that binds Koshmaar – a horrifying creature from another world – is stolen, you embark on a quest that will lead you to the gothic city of Lichtenheim, which is inhabited by Maskwraiths – demonic creatures corrupted by a power from another dimension. Answer the call of the Dark City!', 'https://www.igdb.com/games/grim-legends-3-the-dark-city', '2016-06-02 00:00:00', 33110, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(129, 'Batman & Robin', 'A Batman game released for the Tiger Electronics console R-Zone.', 'https://www.igdb.com/games/batman-and-robin--2', '1998-12-31 00:00:00', 198997, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(130, 'Legend of Dungeon', 'As you journey deep into the dungeon, you will find weapons, items, and long forgotten magic.. ..if you''re lucky, it might help you to fight off the droves of mysterious creatures you will encounter. There will be complete darkness to contend with, potions to quaff, secrets to discover, traps to avoid, hats to wear, and treasure that (if you make it out alive) will make you a legend.\nYou are looking for treasure and glory in a dark flickering dungeon full of deadly monsters. Legend has it there is a massive treasure all the way down on the 26th floor. Your quest: get the treasure, and make it back alive. Which you won''t, you''ll die...\n\n...the game is about dying, and treasure.\n-Legend of Dungeon is a randomly generated action RPG Beat''em''up with heavy Rogue-like elements, striking visuals, and dynamic music.', 'https://www.igdb.com/games/legend-of-dungeon', '2013-09-13 00:00:00', 7885, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(131, 'TNN Outdoors Bass Tournament ''96', 'TNN Outdoors Bass Tournament ''96 is the sequel to TNN Bass Tournament of Champions. It shares many elements with the PC game of the same name, but that version has an isometric-style map and a full 3D view for the fishing sequences. Just like the original game it is a fishing simulator that allows the player to access a free fishing mode or to participate in a fishing tournament. First, equipment needs to be bought. It consists of lures, rods, reels, lines and boats. Better items can only be acquired by winning money in tournaments.', 'https://www.igdb.com/games/tnn-outdoors-bass-tournament-96', '1996-02-01 00:00:00', 46244, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(132, 'Space Walk', 'A clone of Circus, in this variant it is not clowns but astronauts bouncing on a see-saw in order to collect items up in the air.', 'https://www.igdb.com/games/space-walk', '1978-12-31 00:00:00', 170527, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(133, 'For My Babies', 'Medium sized dark Wizard/Metal map', 'https://www.igdb.com/games/for-my-babies', '1997-08-05 00:00:00', 270770, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(134, 'Cat Frenzy', 'Slide & Match adorable kittens to set them free in over 101 levels full of puzzles and purrs!', 'https://www.igdb.com/games/cat-frenzy', '2012-06-07 00:00:00', 84590, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(135, 'No Heroes Allowed: No Puzzles Either!', 'HEROES… WELCOME TO YOUR DOOM\nAs the all-powerful God of Destruction, you must quickly move falling tiles to match three or more identical icons – which will then summon a pack of deadly monsters hungry for juicy hero flesh.', 'https://www.igdb.com/games/no-heroes-allowed-no-puzzles-either', '2014-04-15 00:00:00', 8663, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(136, 'Twilight Survivors', 'Wield 5+ powerful Super Weapons all together! Face 300 enemies at the same time! Will you survive?', 'https://www.igdb.com/games/twilight-survivors', '2024-02-15 00:00:00', 285351, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(137, 'SD Gundam Battle Alliance: Deluxe Edition', 'The Deluxe Edition includes:\n• SD GUNDAM BATTLE ALLIANCE (full game)\n• Season Pass\n• Early unlock for the Command Gundam unit premium edition bonus\n\nIn SD Gundam Battle Alliance, Mobile Suits and characters from across Mobile Suit Gundam history take center stage in this all-new action RPG.', 'https://www.igdb.com/games/sd-gundam-battle-alliance-deluxe-edition', '2022-08-25 00:00:00', 212627, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(138, 'Furni-Jumpin''', 'Watch out for those furniture! Furni-Jumpin'' is a 2D platformer arcade game where you take control of a weird little creature dodging enemies and collecting items while jumping on furniture.', 'https://www.igdb.com/games/furni-jumpin', '2023-07-03 00:00:00', 255132, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(139, 'Round-Up', '', 'https://www.igdb.com/games/round-up', '1981-12-01 00:00:00', 92222, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(140, 'Pipe Escape', 'A 2D puzzle game with a spin! Make your way through obstacle courses of pipes, water streams and bats as fast as you can whilst spinning out of control.', 'https://www.igdb.com/games/pipe-escape', '2024-03-06 00:00:00', 289606, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(141, 'An Opportunity', 'So you know that one rover that landed on Mars? Yeah this isn''t that.', 'https://www.igdb.com/games/an-opportunity', '2022-09-09 00:00:00', 215527, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(142, 'The Lost Robot: Jigsaw Puzzle Stories', 'Find help for a lost robot by restoring its memory.', 'https://www.igdb.com/games/the-lost-robot-jigsaw-puzzle-stories', '2021-06-24 00:00:00', 155470, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(143, 'Timelie: Game of the Year Edition', 'Timelie is a stealth puzzle adventure, where you control time like a media player. Perceive future events to plan your escape strategy from the past, sneak an enemy, and manipulate time through this companionship journey of a mysterious cat and a little girl with a precognitive power.\n\nTimelie: Game of the Year Edition includes:\n- a copy of the base game\n- a copy of the Hell Loop DLC', 'https://www.igdb.com/games/timelie-game-of-the-year-edition', '2021-05-28 00:00:00', 169192, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(144, 'Kometen', 'A comet has been born, please take good care of it! Explore the universe and learn how to fly in a graceful way. A beautiful and memorable experience for everyone!', 'https://www.igdb.com/games/kometen', '2010-05-12 00:00:00', 200935, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(145, 'Raid', 'Three Stones has changed while I was away. A celebration timed to a long-awaited homecoming was made into a weird, disturbing crime scene. Wary looks watching your every step, no trust, no smile... but I''ll find the truth.', 'https://www.igdb.com/games/raid--1', '2020-06-25 00:00:00', 170805, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(146, 'Insect Adventure', 'Experience an action packed adventure as a young cockroach named Bugsy as he and his friend Mayo explore an uncharted cave. Misfortune ensues as a monstrous lizardman kidnaps Mayo and an earthquake further separates the two. Armed with a hammer, quick feet and determination, Bugsy sets off into an underground labyrinth full of crumbling ruins, mysterious relics, and loads and loads of monsters. Will he make it alive, and what mysteries does the underground labyrinth hold?\nFeatures:\n-Fast-paced, action packed metroidvania-style goodness that does not hold back!-Battle against hoards of crawling, rolling and flying insects. Perform combo attacks with your hammer and sub-weapons, and even juggle enemies. Crank up the difficulty and find yourself surrounded by dozens of enemies!\n-Fight massive bosses with intricate behaviors. Learn their patterns and weaknesses, and become the boss of them!\n-Explore a massive map with lots of winding paths, secret areas and shortcuts. Multiple playthroughs and speedrunning are greatly encouraged!-Loads of abilities to discover. Sub-weapons, movement tech, and equippable augmentations are all at your disposal! Mix and match abilities to how you see fit in your playstyle. No two playthroughs will look the same!', 'https://www.igdb.com/games/insect-adventure', '2020-10-20 00:00:00', 140373, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(147, 'DruMidia', 'DruMidia is a VR drumming music game. Players can use midi file as a custom chart!', 'https://www.igdb.com/games/drumidia', '2020-11-22 00:00:00', 159954, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(148, 'Simple 2500 Series Portable Vol. 9: The My Taxi!', 'The My Taxi! is a Racing game, developed by Tamsoft and published by D3Publisher, which was released in Japan in 2007.', 'https://www.igdb.com/games/simple-2500-series-portable-vol-9-the-my-taxi', '2007-02-22 00:00:00', 203398, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(149, 'Trophy Knight', 'Battle hordes of enemies and bosses in this level based action platformer. Find new weapons and level up your hero along the way. Explore deep dungeons to retrieve epic treasures for your trophy room!', 'https://www.igdb.com/games/trophy-knight', '2024-12-31 00:00:00', 219527, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(150, 'Drivin'' Force', '', 'https://www.igdb.com/games/drivin-force', '1990-12-31 00:00:00', 12575, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(151, 'Escape First', '"Escape First" is a multiplayer escape room puzzle game for virtual reality or desktop PC! It includes 3 different escape rooms to choose from and can be played competitively, co-op or solo.', 'https://www.igdb.com/games/escape-first', '2018-05-10 00:00:00', 97243, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(152, 'Apple Jack', 'Apple Jack is an Xbox Live Indie game developed by British independent developer Tim Sycamore under the name My Owl Software. The game was published in May 2010. It is a 2D puzzle/platform game. \n \nThe game''s plot revolves around Apple Jack rescuing his dogs from kidnappers.', 'https://www.igdb.com/games/apple-jack', '2010-05-01 00:00:00', 91905, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(153, 'Root Infinity Rexx: Limited Edition', 'Root Rexx, stylized as ROOT∞REXX, is an otome visual novel video game developed by Otomate, exclusively released for the PlayStation Vita by Idea Factory on January 22, 2015 in Japan. The game follows Mochizuki Kazune, a teenage girl who meets members of the fictional boy band Rexx.\n\nThe limited edition comes with a special booklet and exclusive drama CD.', 'https://www.igdb.com/games/root-infinity-rexx-limited-edition', '2015-01-22 00:00:00', 254365, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(154, 'Fragments of a Mind', 'Help Cassandra uncover the truth behind her family''s betrayal in this action packed adventure game full of intricate puzzles, vicous enemies and deadly traps.', 'https://www.igdb.com/games/fragments-of-a-mind', '2022-03-25 00:00:00', 157428, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(155, 'Super Tempo', 'Tempo now teams up with its eponymous host and his girlfriend Katy to rescue the Prince of Music World from Planet Technotch.', 'https://www.igdb.com/games/super-tempo', '1998-05-29 00:00:00', 46050, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(156, 'Purgatory', 'Most stories end with the death of the protagonist. For Xzus, death is where things started to get really interesting...', 'https://www.igdb.com/games/purgatory', '2016-06-22 00:00:00', 27773, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(157, 'Don Orlo''s Magazine: Issue #1', '', 'https://www.igdb.com/games/don-orlos-magazine-issue-number-1', '2020-01-12 00:00:00', 252545, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(158, 'Classic Axiens', 'A shoot''em up based on Namco''s arcade game Galaxian, where the player controls a spacecraft at the bottom of the screen moving left or right, destroying aliens above.', 'https://www.igdb.com/games/classic-axiens', '1987-12-31 00:00:00', 60221, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(159, 'Ballsy! World Cup 2020', 'Retro football game, with local coop & cup mode. Less sluggish than modern football games, but with more ''weighty'' physics than most retro football games. No referee, so no offside or fouls - all is permitted.', 'https://www.igdb.com/games/ballsy-world-cup-2020', '2020-10-28 00:00:00', 143800, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(160, 'In the dark forest', '"In the dark forest" is a 2d side-scroller defense game. Improve your skills and upgrade weapons, protect your home from waves of undead!', 'https://www.igdb.com/games/in-the-dark-forest', '2021-03-28 00:00:00', 158251, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(161, 'Melodia', 'Melodia is a Yume Nikki fangame. As the title suggests, has a major musical motif. The objective is to collect Melodies throughout the dream world, accessed through falling asleep in front of the TV. Collecting Melodies causes more doors to appear at the Nexus.', 'https://www.igdb.com/games/melodia', '2010-08-06 00:00:00', 225365, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(162, 'Number 94', 'A short experimental horror game about infra-red and the dangers beyond our perceived color spectrum.', 'https://www.igdb.com/games/number-94', '2020-04-11 00:00:00', 239527, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(163, 'War and Order', 'A MMORPG for Mobile and Tablet users.', 'https://www.igdb.com/games/war-and-order', '2016-04-06 00:00:00', 56951, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(164, 'Spacky''s Nightshift', 'Survival horror adventure in a ''90s restaurant.', 'https://www.igdb.com/games/spackys-nightshift', '2020-03-11 00:00:00', 137235, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(165, 'Crucible', 'Crucible is a team-based action shooter driven by the choices you make. Each match in Crucible is a fight for survival and control. Not only will you be going toe-to-toe with your fellow competitors, but you’ll have to adapt and overcome all the challenges the planet itself throws your way. You and your teammates will need to work together to take down alien creatures, capture objectives, and pursue your opponents in search of victory.\n\nAfter its May 20th launch and pre-season that lasted till June, Crucible switched to closed beta in July to adjust the game based on user feedback with scheduled community events and tournaments.\nOn October 9th it was announced that development would be discontinued and the team would transition to working on New World and other upcoming projects.\n\nThere will be a final playtest and community event before match making is taken offline leaving custom games the only available mode till the servers are shutdown on November 9th.', 'https://www.igdb.com/games/crucible', '2020-05-20 00:00:00', 24653, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(166, 'Johnny Turbo''s Arcade: Heavy Burger', 'Blast, dodge, and charge your way through an array of classic 1980''s Data East arcade machines. 1-4 Players can battle against time-honored characters in a nostalgia-inducing collage of retro set-pieces from BurgerTime, Karate Champ, Lock ''N Chase, Heavy Barrel, Side Pocket, and Bad Dudes!', 'https://www.igdb.com/games/johnny-turbos-arcade-heavy-burger', '2021-04-28 00:00:00', 110755, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(167, 'Aces High III', 'Aces High III offers world class modeling of World War II planes, vehicles, and boats in a combat setting with hundreds of other players pitting their skills in any given online arena.', 'https://www.igdb.com/games/aces-high-iii', '2017-08-23 00:00:00', 55527, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(168, 'Lucky Luke', '', 'https://www.igdb.com/games/lucky-luke', '1999-05-01 00:00:00', 265060, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(169, 'B.C. Bill', 'In this cartooney club-em-up, released in 1984 for home microcomputers by Imagine, take on the role of the titular B.C. Bill, a true paragon of prehistoric sensibilities, solving all his many issues with his versatile wooden club.', 'https://www.igdb.com/games/bc-bill', '1984-12-31 00:00:00', 15655, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(170, 'Zone 22', 'Zone 22 is a first person game set in an alternative universe where the Nazis won against the race towards the Atom bomb and conquered the world during World War 2. You as the player is a part of the wonderful society of Zone 22, where you need to survive each and everyday by behaving, working and eating. Or will you rebel against this tyrannic foe?', 'https://www.igdb.com/games/zone-22', '2015-06-05 00:00:00', 17806, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(171, 'Sledge 3D', 'A demo program for the 3-D Goggles. BaronVR described it like this : "The effect is that of a track extending from the monitor surface to about 3 feet inside the monitor surface, the speed controlled by pushing up or down on the joystick..."', 'https://www.igdb.com/games/sledge-3d', '1983-02-01 00:00:00', 44303, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(172, 'Shared Beauty', 'Shared Beauty is a dark fairy tale about jealousy, friendships lost, and aging, set in a fictional medieval German village.', 'https://www.igdb.com/games/shared-beauty', '2023-10-01 00:00:00', 270760, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(173, 'RE: Get to Schol on Time', 'Help Fuller on his odyssey through the back streets of England in 2003, as he tries to get to school against the clock. The game contains 5 distinct sections, each with a unique gameplay mechanic. WARNING: This title is famously difficult. Only intended for highly skilled players.', 'https://www.igdb.com/games/re-get-to-schol-on-time', '2020-10-01 00:00:00', 140865, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(174, 'Glory Days: Tactical Defense', 'Time to get tough!', 'https://www.igdb.com/games/glory-days-tactical-defense', '2011-01-17 00:00:00', 84509, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(175, 'Akashicforce', 'Akashicforce is a puzzle-game-like, rhythm-game-like game where you input commands to use moves like in a fighting game. The goal is to crush your opponent to a pulp with an immense amount of blocks.', 'https://www.igdb.com/games/akashicforce', '2019-03-29 00:00:00', 116199, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(176, 'Animal Crossing: Wild World', 'Players move into a living, breathing world inside the Nintendo DS...and then invite their friends to visit from anywhere on earth. In Animal Crossing: Wild World, the sequel to the popular Nintendo GameCube game, players and up to three friends can hang out in the same village and interact in real time -- either through wireless LAN or over Nintendo Wi-Fi Connection. Players can visit a friend''s village from thousands of miles away. The touch screen makes item management and world navigation a breeze. Typing letters and designing patterns are now just stylus strokes away. Days and seasons pass in real time, so whether players want to decorate their homes, catch bugs or fish, collect brand-new items like hats and sunglasses or just chat with the wild and wacky characters in their villages, there''s always something to do.', 'https://www.igdb.com/games/animal-crossing-wild-world', '2005-12-05 00:00:00', 2645, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(177, 'Hidden Stroke II: APRM', '', 'https://www.igdb.com/games/hidden-stroke-ii-aprm', '2005-12-31 00:00:00', 209903, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(178, 'Jolly Roger', 'A short BL Visual Novel about romance and pirates. Spanish and English available.', 'https://www.igdb.com/games/jolly-roger--1', '2021-08-19 00:00:00', 176828, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(179, 'Kid Chaos', 'Kid Chaos (also known as Kid Vicious) is a side-scrolling platform video game that Magnetic Fields developed, and Ocean Software published, for the Amiga and Amiga CD32 in 1994', 'https://www.igdb.com/games/kid-chaos', '1994-12-31 00:00:00', 12655, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(180, 'Gold Magic 800', 'A puzzle game that will teach your unconscious mind to think like an entrepreneur.', 'https://www.igdb.com/games/gold-magic-800', '2018-09-25 00:00:00', 109897, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(181, 'Power Spike: Pro Beach Volleyball', 'Put away that suntan lotion, because you''re not going to need it for this beach volleyball game. That''s not to say the action isn''t hot, as you form a two-person team and battle the superstars of volleyball. Licensed by the FIVB, POWER SPIKE PRO BEACH VOLLEYABALL features over 40 real heroes of the pro circuit, such as Gabrielle Reece and Sinjin Smith. You''ll play in real-life environments set in 14 different locations spanning the globe. Travel to Sydney, Osaka, Los Angeles, and lots of other great cities as you spike and dig your way to hard-fought victory. If you''d like to see how your own creations fare against the world''s best, create your own player based on a list of physical traits and abilities, then pick a partner and serve it up. Real volleyball physics are in place, making every bump and spike look and feel like the real thing. The graphics and animations will rock your world as you play in several competitive modes. If you have a Multi-tap and four controllers, you can even play a four-player extravaganza, each player taking on a different star or created athlete in a two-on-two match-up.', 'https://www.igdb.com/games/power-spike-pro-beach-volleyball', '2000-12-21 00:00:00', 44888, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(182, 'Wonder Boy Returns Remix', '"Wonder Boy" was an arcade hit back in 1986, with its intuitive controls and polished game balance.\n\nThis forever famous sidescrolling action game has been remixed and reborn for Nintendo Switch!\n\nJoin the adventure of a boy who''s doing his best to save his girlfriend Tina -- updated with high-def anime-inspired visuals!', 'https://www.igdb.com/games/wonder-boy-returns-remix', '2019-05-23 00:00:00', 115993, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(183, 'MULE Returns', 'MULE is a ridiculously fun and addictive strategy game that combines real-time and turn-based styles as you battle for land and resources on a newly colonized planet. The game is easy to grasp but provides great depth of game-play.', 'https://www.igdb.com/games/mule-returns', '2013-11-25 00:00:00', 91151, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(184, 'Rodent People: Origins', 'Rodent People: Origins is a VR escape room, in which teams of up to 4 players use their wits to solve innovative, story-driven puzzles to try and break out of a prison cell.', 'https://www.igdb.com/games/rodent-people-origins', '2021-03-18 00:00:00', 145164, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(185, 'Pong: The Next Level', '', 'https://www.igdb.com/games/pong-the-next-level--1', '1999-12-01 00:00:00', 265058, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(186, 'Sea Fever', 'Sea Fever is a horror visual novel with blood, gore, abusive relationships, and monsters. Dive in, but beware!\n\nMarella and Dylan are girlfriends who live a quiet and self-sufficient life in paradise. But Dylan''s dreams and ambitions are greater than a little house by the sea, and she is drawn to the city to pursue her acting career.\n\nNow, bound together only by letters, Marella must face not only the pressures of keeping up a long distance relationship, but a strange and growing sickness, and dark monsters from the only place she''s ever considered home.\n\nCan Dylan and Marella''s relationship survive? And what, exactly, is the monster plaguing her nightmares?', 'https://www.igdb.com/games/sea-fever', '2023-10-01 00:00:00', 270759, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(187, 'Mello', 'Hop, jump, and stick your way through a forest under threat to save your friends and family from the evil Flame Beast and his Embers.', 'https://www.igdb.com/games/mello', '2021-10-25 00:00:00', 188917, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(188, 'Harry Potter RPG', 'Harry Potter fan-game.\n\nCreate your own Hogwarts student (House, blood status, look...) and go for a year of magical study in the school of witchcrat and Wizardry !\n\nWill you choose to help the Order of the Phoenix, or will you join the Death-eaters? The choice is yours.\n\nYou will have to accomplish missions for them, and explore the wizard world to increase your skills.\n\nWill you pass your exams? What will you become at the end? It''s all up to you!\n\nInspired by the "Harry Potter" saga by J.K. Rowling. Some liberties have been taken for the needs of the game compared to the original text.', 'https://www.igdb.com/games/harry-potter-rpg', '2019-03-08 00:00:00', 141244, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(189, 'Immerse Land', '"Immerse Land" is a role story adventure game and a full-screen interactive micro-drama. You can enter different stories by through different choices. Emma drove her daughter to the amusement park, but they had an accident. Her daughter was lost mysteriously and Emma entered the lighthouse in search of her daughter with a few clues......', 'https://www.igdb.com/games/immerse-land', '2020-10-01 00:00:00', 146753, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(190, 'Boulder Dash', '', 'https://www.igdb.com/games/boulder-dash--10', '1986-12-31 00:00:00', 280830, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(191, 'Tank Blast', 'Bright and hardcore return of arcade tanks! Thunderous explosions and exciting gameplay await you on colorful levels, which are full of dastardly enemies with clever AI! Well, can you get to the end?', 'https://www.igdb.com/games/tank-blast', '2016-07-13 00:00:00', 33010, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(192, 'Please, Forgive Me', '"Please, Forgive Me" - is a psychological horror game that tells the creepy story of an overconfident realtor named Pavel. He needs to check the old apartment and rent it to a certain woman. This night will turn into a real nightmare for him.', 'https://www.igdb.com/games/please-forgive-me', '2023-07-17 00:00:00', 256995, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(193, 'Franchise Hockey Manager 3', 'Franchise Hockey Manager 3 is the deepest, most authentic hockey strategy game you can find! Now officially licensed by the NHL®, so you can take the reins of your favorite franchise, FHM3 includes real 2016-2017 rosters for 22 playable leagues, a new gameplay mode that makes the game much more approachable, and tons of other new features!', 'https://www.igdb.com/games/franchise-hockey-manager-3', '2016-10-31 00:00:00', 25655, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(194, 'Morning Mushrooms', 'A Flatgame about foraging for mushrooms.', 'https://www.igdb.com/games/morning-mushrooms', '2018-04-22 00:00:00', 182808, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(195, 'Fullmetal Alchemist: Brotherhood', 'Fullmetal Alchemist: Brotherhood''s ''Adventure Mode'' lets players live the adventure of the Elric brothers as they strive to foil a foul plot and take on other powerful alchemists in battles to the death. The game features a host of additional customizable playable characters with points earned in battle used to upgrade their special powers and abilities. The fights go down in a series of different battle arenas where players can flex their spectacular alchemist abilities, use the terrain’s topography strategically to gain the upper hand, and judiciously launch special Combination Attacks with their battle partner to turn the tide of battle.', 'https://www.igdb.com/games/fullmetal-alchemist-brotherhood', '2010-06-11 00:00:00', 25172, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(196, 'Hacker''s Adventure', 'Get ready for a breathtaking platform adventure. Help Super Hacker collect hi-tech products.', 'https://www.igdb.com/games/hackers-adventure', '2020-09-07 00:00:00', 142244, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(197, 'Faceted Flight', 'Faceted Flight is a stylized stunt flight game designed to deliver the thrill of flight.  \nTake control of the Hover Jet and challenge ghost racers in Ring Attack or just relax and explore Free Flight....or you could always hop into the cockpit of the Jump Seat and give Target Practice a try.  \n \nWhat are you waiting for? Do a barrel roll. \n \nWhat are you waiting for? Do a barrel roll.', 'https://www.igdb.com/games/faceted-flight', '2016-10-05 00:00:00', 35655, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(198, 'Master of The Secret Sea', 'Hire a crew, trade goods, and engage in classic sea battles to build your reputation as the captain of a pirate ship.', 'https://www.igdb.com/games/master-of-the-secret-sea', '2008-09-16 00:00:00', 270479, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(199, 'Territory War 3', 'Online sequel to the popular flash arena frag games, Territory War. Features new maps, new weapons, gameplay modes and new ways to earn XP, and level up. Including a new level editor, for you to create the arena of your dreams - and your friend''s nightmares.', 'https://www.igdb.com/games/territory-war-3', '2012-12-31 00:00:00', 234156, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(200, 'Fearmonium', 'Fearmonium is a psychedelic action-platformer where suspense intertwines with humor. Start the game as the usual unpleasant memory and, reincarnate into a real phobia by breaking through the most hidden corners of consciousness of Jimmy.', 'https://www.igdb.com/games/fearmonium', '2021-05-20 00:00:00', 118100, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(201, 'Soccer Tsuku DS: World Challenge 2010', 'Saka Tsuku DS: World Challenge 2010 is an entry in Sega''s Let''s Make series for the Nintendo DS.', 'https://www.igdb.com/games/soccer-tsuku-ds-world-challenge-2010', '2010-05-27 00:00:00', 65014, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(202, 'Fido Dido', 'A cancelled SNES game featuring the cartoon character and brand mascot Fido Dido.', 'https://www.igdb.com/games/fido-dido', '1994-12-31 00:00:00', 93010, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(203, 'Fucking Hell', 'Short Adult-Only Visual Novel featuring 4 girls in Hell with different personalities, fetishes, and stories.', 'https://www.igdb.com/games/fucking-hell', '2022-06-02 00:00:00', 204026, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(204, 'Master Maker 3D Ultimate', 'Clear retro 3D levels or build your own in this 3D action platformer for all ages!', 'https://www.igdb.com/games/master-maker-3d-ultimate', '2024-03-20 00:00:00', 284785, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(205, 'Exolon', 'Si creías haber visto todo en video-aventuras espera a ver EXOLON. Las críticas de este juego han sido unánimes: declarado "Classic" por Sinclair User, "Mega-Game" por Your Sinclair, "Master Game" por Amstrad Action, "Hit" por Computers & Video Games... ¿puedes perdértelo?', 'https://www.igdb.com/games/exolon', '1989-12-31 00:00:00', 12586, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(206, 'Head to Head Talking Tennis', '', 'https://www.igdb.com/games/head-to-head-talking-tennis', '1988-12-31 00:00:00', 217670, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(207, 'Anastasia', 'A handheld game based on the homonymous movie.', 'https://www.igdb.com/games/anastasia', '1997-12-31 00:00:00', 198670, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(208, 'Pyramid Raiders', 'Pyramid Raiders is a hilarious split-screen game where four bumbling soldiers sneak out of their base to steal tons of gold from mysterious tombs. With physics-based gameplay and silly puzzles, players must navigate through obstacles and traps to successfully make their escape with all their loot.', 'https://www.igdb.com/games/pyramid-raiders', '2023-03-02 00:00:00', 242974, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(209, 'Zero One SP', 'Nagoya always suffers from mysterious dreams. One day he is invited by his classmates on a drinking party to celebrate the last day of semester. They hear piano playing at night school. Depending on actions, the mystery can have four absolutely different and often fantastic reasons.', 'https://www.igdb.com/games/zero-one-sp', '2004-04-29 00:00:00', 93952, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(210, 'Chicken Scream', 'In Chicken Scream, you use your voice to control how far the chicken will jump, aiming for the highest score', 'https://www.igdb.com/games/chicken-scream', '2017-03-23 00:00:00', 101190, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(211, 'ArcPinball', 'A pinball game made by Shibumi Soft.', 'https://www.igdb.com/games/arcpinball', '1990-12-31 00:00:00', 13242, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(212, 'ELOA: Elite Lord of Alliance', 'ELOA is an anime-inspired triple action hack and slash MMORPG, with familiar Action RPG controls and an isometric view on your character. Players can choose between one of 5 playable classes among 4 races, with each class having access to 3 combat stances. ELOAs unique gameplay revolves around tactically switching between the three stances mid-combat, while each stance offers a different playstyle and purpose. ELOA is set in a vibrant, open world full of PvP battles, quests & dungeon raids. It comes with and instance party finder system and features an extensive pet & costume system to suit all players.', 'https://www.igdb.com/games/eloa-elite-lord-of-alliance', '2016-02-01 00:00:00', 26535, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(213, 'Aces High', '', 'https://www.igdb.com/games/aces-high', '1984-12-31 00:00:00', 15587, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(214, 'Galaxian Fever', 'A medal game released in Japan. Part of Namco''s Shooting Medal series. Players used an attached gun to shoot coins at on-screen targets.', 'https://www.igdb.com/games/galaxian-fever', '2000-07-14 00:00:00', 230590, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(215, 'Trainz Railroad Simulator 2019: Willamette & Pacific SD7 #1501', 'This session lets you jump straight in and drive the Willamette & Pacific SD7 #1501 in ''easy'' or ''realistic'' mode. For the full experience, select ''Realistic Mode'' and start driving this beautiful locomotive!', 'https://www.igdb.com/games/trainz-railroad-simulator-2019-willamette-and-pacific-sd7-number-1501', '2019-01-07 00:00:00', 153244, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(216, 'Battle Village', 'Battle Village is a top down shooter where the player has to control a tank and defend the base from enemies.', 'https://www.igdb.com/games/battle-village', '2020-08-10 00:00:00', 149643, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(217, 'Tamagotchi Connection: Corner Shop', 'Tamagotchi Connection: Corner Shop lets you assist your virtual pet in building a business. Ten different shops act as unique minigames in which you must control your Tamagotchi character and assist customers. Three different playable characters are available, all with different personalities. The game also features stylus support to let you take advantage of the touch-screen features of the DS. Also, the multiplayer mode lets players swap in-game items.', 'https://www.igdb.com/games/tamagotchi-connection-corner-shop', '2006-01-31 00:00:00', 20491, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(218, 'Doge Dimensions', 'Blast through the Doge Dimensions and explore the multiverse in this open world adventure. Fly, dash, and defy gravity as you discover unknown terrain and take on a variety of challenges.', 'https://www.igdb.com/games/doge-dimensions', '2022-01-21 00:00:00', 187527, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(219, 'One Bit Arena', 'In the future, the games have evolved to the next level. You participate in the game called the Arena. Your task is to survive, your only tool is a disk. \nYour obstacles are robots developed by the scientists, and the price on your head.', 'https://www.igdb.com/games/one-bit-arena', '2018-03-16 00:00:00', 86762, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(220, 'Sakigake!! Kuromati Koukou', 'A party/board game developed by Hudson Soft and published by DigiCube, featuring a wide array of mini-games for up to four players. Based on the anime/manga series of the same name (Known as Cromartie High School in the west).', 'https://www.igdb.com/games/sakigake-kuromati-koukou', '2003-02-20 00:00:00', 56960, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(221, 'Street Boyz', 'Street Boyz is an Action game, developed by Tamsoft and published by D3Publisher, which was released in Japan in 2004.', 'https://www.igdb.com/games/street-boyz', '2004-11-11 00:00:00', 43237, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(222, 'Beyond the Veil', 'Beyond The Veil (formally The Last Road) is a text-based game about life, death, and faith. Set in a desolate future players take the role of The Driver- a man who has had his faith taken away from him by the murder of the love of his life. Set across 3 acts with multiple supporting characters, the player will be forced to collect and manage vital resources in order to stay alive and to flee the ever-present danger of the oncoming world-storm. The Last Road is a unique and modern take on text-based games.', 'https://www.igdb.com/games/beyond-the-veil', '2019-04-19 00:00:00', 80859, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(223, 'Creatura', 'Seed, Breed, Create. From single cell organisms to complex ecosystems. Evolve every part of your own unique aquarium / terrarium by applying realistic principles of natural and artificial selection, in Creatura - ultimate Virtual Evolution Vivarium Simulator.', 'https://www.igdb.com/games/creatura', '2021-03-31 00:00:00', 82351, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(224, 'Downfall', 'Quiet Haven Hotel was supposed to be just a one night shelter for Joe and Lucy Davis. But things soon start to go wrong. Lucy''s panic attacks get worse and soon she disappears. And in the morning, the hotel changes too. Nothing is what it seems anymore. Joe is left alone, trying to understand what is happening, trapped between reality and this nightmare.', 'https://www.igdb.com/games/downfall--2', '2009-06-16 00:00:00', 213124, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(225, 'Madela', 'Madela is a daily life simulation in the form of a video game that includes daily problems, arguments, and even bad dreams!', 'https://www.igdb.com/games/madela', '2020-01-07 00:00:00', 127859, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(226, 'Aquaculture Land: Fish Farming Simulation', 'Aquaculture Land is an aquafarming simulation game. In this game, you will act as a businessman that runs a freshwater fish farm. You will manage all things related to fisheries, conduct researches, and hunt for new species to get benefits for your business.', 'https://www.igdb.com/games/aquaculture-land-fish-farming-simulation', '2019-06-07 00:00:00', 111859, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(227, 'Machinations: Fog of War', 'Gunpowder diplomacy in a city primed to explode! Steal, lie, and persuade your way to success. Navigate plots and treachery as a shapeshifting android.', 'https://www.igdb.com/games/machinations-fog-of-war', '2016-08-19 00:00:00', 31582, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(228, 'Trainbow', 'TRAINBOW is a mouse-based, maze-action game about collecting bulbs and restoring colour to the world! With a click of your mouse, you can lay down five consecutive tracks for your heroic Manpuck to travel along - and as Manpuck moves faster, so does the world around them.', 'https://www.igdb.com/games/trainbow', '2021-06-10 00:00:00', 182229, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(229, 'Glass', 'Bring together desires that are scattered into bits and pieces. And discover the secrets of the ''World of Glass''.', 'https://www.igdb.com/games/glass--3', '2020-11-22 00:00:00', 171995, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(230, 'Baby Dino Adventures', 'Baby Dino Adventures is a cute platformer game inspired by classic retro games. You play a lost baby T-Rex, and help him find his parents back. You won''t kill anyone. But rather solve puzzles, and make new allies throughout this upcoming adventure.', 'https://www.igdb.com/games/baby-dino-adventures', '2020-07-01 00:00:00', 137893, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(231, 'Hade', 'Hade is a minimalist logic game with severely difficult puzzles softened by relaxing ambient music.', 'https://www.igdb.com/games/hade', '2016-12-02 00:00:00', 30655, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(232, 'Cade Prime', 'Cade Prime is the DoD''s most advanced android. Bad Dudes have placed him inside of the Mainframe. Can You help him solve challenging puzzles in order to escape ?', 'https://www.igdb.com/games/cade-prime', '2021-09-30 00:00:00', 173244, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(233, 'Tank', '', 'https://www.igdb.com/games/tank--1', '2002-12-31 00:00:00', 118644, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(234, 'Winter With You', 'Naoki was really excited about spending Christmas with his beloved. But those plans weren''t meant to be - Naoki saw her hugging another guy. Christmas seems ruined but just one random encounter can change everything. This is a Japanese-style kinetic visual novel about the Christmas.', 'https://www.igdb.com/games/winter-with-you', '2022-01-31 00:00:00', 188108, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(235, 'Baldur''s Gate Compilation', 'Special 4-game DVD-ROM \n \nPlay the original Baldur''s Gate game \n \nIncludes Tales of The Sword Coast Expansion \n \nExplore unseen lands as you take part in an epic conflict that will define your future, and create your legend \n \nVenture into a deadly new dungeon \n \nCast powerful new spells \n \nGain amazing high-level abilities \n \nPlay a new character kit, the Wild Mage \n \nFight and summon awe-inspiring D&D characters \n \nPlay the full version of Baldur''s Gate II - Shadows of Amn, you will face deadly foes armed with your wits, skills and magic -- collect allies and form a party that takes you into the hostile land of Amn for treasure and glory \n \nAlso features real-time gameplay and the ability to pause at any time -- plus all-new multiplayer games for up to 6 players \n \nIn Baldur''s Gate II - Throne of Bhaal, you''ll uncover the mysteries of Watcher''s Keep, explore new dungeons, and use the all-new character called the Wild Mage.', 'https://www.igdb.com/games/baldurs-gate-compilation', '2006-06-30 00:00:00', 141859, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(236, 'Cute Monsters Battle Arena', 'Massively addictive turn based strategy RPG with intense action & puzzles.', 'https://www.igdb.com/games/cute-monsters-battle-arena', '2017-08-25 00:00:00', 55655, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(237, 'Lost in Vivo', 'A horror game about claustrophobia. During a storm your service dog is forced down a broken sewer drain. You find the nearest sewer entrance and run in after it. Along the way you will meet others that are also stricken by abnormal or psychological fear.', 'https://www.igdb.com/games/lost-in-vivo', '2018-11-05 00:00:00', 111248, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(238, 'Rail Trail', 'Rail Trail is a game where you need to create rail systems that will guide gold to its destination.', 'https://www.igdb.com/games/rail-trail', '2022-04-22 00:00:00', 199173, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(239, 'Prototype Blocks', 'Prototype Blocks is a puzzle game with many different levels of varying difficulty.', 'https://www.igdb.com/games/prototype-blocks', '2021-11-14 00:00:00', 191244, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(240, 'Monsterbag', 'Nia''s left her backpack at home and headed out all alone into a world full of danger. But luckily, this is no ordinary backpack. You are V, Nia''s monster bag – and it''s up to you to keep her safe.\n\nAvoid the violent wrath of angry citizens, bloodthirsty aliens and the inept military, or you''ll end up as a pile of monster mush! Catch up to Nia without being seen, oh and… watch out for the apocalypse.', 'https://www.igdb.com/games/monsterbag--1', '2015-04-07 00:00:00', 60535, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(241, 'Cockpit Manager ''14', 'Take control of a Formula 1 team (or customize your own), and try to be the Champion of the world, in this management simulation. \n \nDeal with everything in your team: sign in engine supply contracts, develop your car, attract new sponsors, and hire the best drivers in the world to drive for your own team. In the race, be sure to choose the best tyre and pit stop strategy, to win some places in the grid. \n \nThe game has several playable seasons: the 1976 F1 season, with Lauda and Hunt competing; the 1991 F1 Season, with Ayrton, Piquet, Mansell and Prost in the grid; and the 2000 F1 Season, with Michael Schumacher being the one to beat. \n \nThe game has an in-built Hall of Fame, to which the drivers may be inducted into, if they win titles and races enough. \n \nThere are also 10 Achievements to be unlocked, throughout the seasons. Some of them are really hard to unlock (like winning the Drivers Championship with Rubens Barrichello), which makes this game really challenging.', 'https://www.igdb.com/games/cockpit-manager-14', '2014-05-11 00:00:00', 50330, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(242, 'Solomon''s Key', 'The NES port of Solomon''s Key, a puzzle game developed by Tecmo in 1986 for arcade on custom hardware based on the Z80 chipset. The game is generally recognized as one of the most difficult games to appear on the NES. The player, controlling a sorcerer known only as Dana must overcome unlimited enemy spawning, challenging level designs, a countdown timer, instant death from any physical contact with enemies, and limited ways to dispatch enemies.', 'https://www.igdb.com/games/solomons-key--1', '1986-07-30 00:00:00', 286608, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(243, 'Ganbatte', 'Ganbatte', 'https://www.igdb.com/games/ganbatte', '2018-04-19 00:00:00', 77402, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(244, 'Altorius', 'Altorius combines 2D twin-stick action with platforming, puzzles and more. Includes two full gameplay modes for near-endless gameplay.', 'https://www.igdb.com/games/altorius', '2019-09-06 00:00:00', 121859, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(245, 'Полный улёт', '', 'https://www.igdb.com/games/polnyi-uliot', '2000-12-31 00:00:00', 129105, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(246, 'Saw', 'The story centers on Detective David Tapp who awakens in a decrepit, abandoned asylum. He has been captured by his longtime nemesis, Jigsaw. Obsessed with catching this serial killer, Tapp’s mission has consumed him and ruined his family, resulting in divorce, mental imbalance, and abandonment. Worse yet, this frantic hunt destroyed Tapp’s career while he watched his long-time friend and partner get killed by one of Jigsaw''s traps. Now Jigsaw has the upper hand and has captured the detective. Tapp must play a deadly game—the likes of which he has been investigating for years—to escape, and in order to do so he must survive the lethal traps and puzzles that Jigsaw has put in place for him and others. But each victim has a dark connection to Tapp. Will Tapp save them? Can he survive his obsession to find the Jigsaw killer?', 'https://www.igdb.com/games/saw', '2009-10-06 00:00:00', 7176, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(247, 'Solomon''s Club', 'Solomon''s Club is a puzzle game, developed by Graphic Research and published by Tecmo, which was released in 1991.', 'https://www.igdb.com/games/solomons-club', '1991-04-01 00:00:00', 49018, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(248, 'Knights of Light: The Prologue', 'Action adventure role playing game during medieval age in Middle East. Story is based on a historical battle at the 7th century in Iraq. Inspired by The Witcher and Mount & Blade with a rich story with two playable characters. Relive the battle events and lead your troops to victory.', 'https://www.igdb.com/games/knights-of-light-the-prologue', '2020-02-29 00:00:00', 126859, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(249, 'Super Slap Shot', '', 'https://www.igdb.com/games/super-slap-shot', '1993-12-31 00:00:00', 94561, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(250, 'Beetle Bunt', 'Beetle Bunt is a puzzle game about a beetle that likes to flip objects over. Help Herc the beetle shove tablets under the light, revealing inscriptions on the other side. Beat challenging block rotation and block position puzzles while testing your platforming skills.', 'https://www.igdb.com/games/beetle-bunt', '2020-12-25 00:00:00', 142010, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(251, 'Tiny Civilization', 'This is a historical simulation game that promotes the development of civilization based on the match-3 Game. You''ll need to gather resources, use skills, discover new technology, and lead humanbeing through a 10,000-year journey to the cosmos.', 'https://www.igdb.com/games/tiny-civilization', '2023-01-01 00:00:00', 230647, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(252, 'Theseus: Mythological Hero', 'RPG with a complex maze, full of traps and some puzzles, where the hero must fight the furious minotaur. And also a battle against the god Chronos, to retrieve Athens'' treasure and save the souls of his old friends. Where Princess Ariadne is his only help.', 'https://www.igdb.com/games/theseus-mythological-hero', '2021-07-17 00:00:00', 195315, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(253, 'The Elevator', 'Josh has been working a hotel front desk for a week on the night shift.\n\nAfter realizing that in the elevator of the place there is a mystery... he begins to investigate to find out what is happening.', 'https://www.igdb.com/games/the-elevator--2', '2022-05-05 00:00:00', 252542, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(254, 'Fallen London: Salon Scandal!', 'This is a DLC for the game Fallen London. It is part of the Exceptional Stories, a monthly release of new stories that are available for subscribers (Exceptional Friends) for free, and available for purchase afterwards.', 'https://www.igdb.com/games/fallen-london-salon-scandal', '2022-11-22 00:00:00', 233589, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(255, 'A Dudley Dilemma', 'A Harvard student wakes up with amnesia in a strange building.', 'https://www.igdb.com/games/a-dudley-dilemma', '1989-12-31 00:00:00', 135853, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(256, 'Knights & Guns: Complete Edition', '', 'https://www.igdb.com/games/knights-and-guns-complete-edition', '2023-02-03 00:00:00', 280582, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(257, 'Bitcoin Mining Profit Calculator: Gaiden', '', 'https://www.igdb.com/games/bitcoin-mining-profit-calculator-gaiden', '2015-04-15 00:00:00', 128566, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(258, 'Isles of Sea and Sky', 'A fantastical, oceanic, and open world puzzle adventure game. Solve novel block-pushing puzzles while unearthing a mystifying narrative, awakening delightful new friends, gathering collectables, and unleashing extraordinary powers beyond your wildest imagination.', 'https://www.igdb.com/games/isles-of-sea-and-sky', '2024-12-31 00:00:00', 133013, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(259, 'WarShip HD', 'There are enemies who have powerful warships and weapons in each zone. As you defend an attack by the enemies, you’ll get stronger. As you get stronger, you acquire trophies and in return you get stronger warships, each warship having a special feature. However, there will be pirates that will try to steal your trophies, so keep an eye out and make sure the trophies aren’t stolen.\nWe hope you win by understanding the features of each warship.\nWe wish you your victory.', 'https://www.igdb.com/games/warship-hd', '2010-06-04 00:00:00', 205010, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(260, 'Perfection.', 'Perfection. is a simple, soothing puzzle game about cutting shapes to fit into outlines. There are an infinite number of puzzles, each randomly generated to be unique and interesting.\n\nIts gameplay is very minimalistic and very forgiving; there is no time limit, and you can cut as many times as you want and undo as many times as you want until you get each shape right. Or, you can challenge yourself to clear the shape in front of you in as few cuts as possible. Whether you get it perfect or not, once a shape is completed, it''s gone forever. There''s no commitment to replay any level, because there will always be a new one for you to try.', 'https://www.igdb.com/games/perfection', '2013-07-03 00:00:00', 16621, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(261, 'Sega Vintage Collection: Golden Axe', 'Grab your axe, swords, and mythic steeds to fight against evil in all three classic Golden Axe entries! Originally released for the Sega Genesis, the classic fantasy brawler series has now been updated for release on Xbox LIVE Arcade! Earn all new achievements, take on challenging new game trials, compete with others players across Xbox LIVE Leaderboards, and take on the forces of evil with a friend in two player local and online co-op!', 'https://www.igdb.com/games/sega-vintage-collection-golden-axe', '2012-05-30 00:00:00', 80698, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(262, 'Fugue in Void', 'An interactive experience in which you can explore all kinds of mysterious places and dive into a world full of atmosphere. Let this experience unfold in your head. Let it inspire you.', 'https://www.igdb.com/games/fugue-in-void', '2018-08-03 00:00:00', 105212, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(263, 'Midnight Tales Vol.3: Christmas', 'In the middle of Christmas, a man tells some horror stories to his daughter... but something is very wrong...', 'https://www.igdb.com/games/midnight-tales-vol-dot-3-christmas', '2022-12-23 00:00:00', 252541, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(264, 'Star Wars: Attack on the Death Star', 'Star Wars: Attack on the Death Star recreates the final battle from "Star Wars", putting the player at the controls of an X-Wing starfighter in full 3D. Engage in dogfights with TIE Fighters as you approach the station, and skim Death Star''s surface while dodging turbolaser towers and shoot the torpedo run down the trench.\n\nAttack on the Death Star features digitized voices and 3D wireframe vector graphics!', 'https://www.igdb.com/games/star-wars-attack-on-the-death-star', '1992-01-13 00:00:00', 45379, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(265, 'City of Heroes: Going Rogue', 'City of Heroes: Going Rogue was released in 2010. Unlike City of Villains, Going Rogue was an expansion rather than a Stand Alone and required the original game(s) to play. Going Rogue added an Alignment system, which allowed players to switch from Hero to Villain and added two intermediate Alignments: Vigilante, as a player progresses from Hero to Villain, and Rogue, as a player progresses from Villain to Hero. Players with Vigilante or Rogue characters had access to both City of Heroes''s Paragon City and City of Villains''s Rogue Isles until they change to Hero or Villain. The expansion also added the Praetorian Earth dimension where players could start out as neutrally-aligned Praetorians (choosing any of the ten basic Archetypes available to Heroes or Villains), either deciding to side with Emperor Cole''s ruling faction and become a Loyalist or side with the Resistance; the allegiance could change as the player chose and completed missions. Praetorian players could also attack new Neutral mobs and would eventually be able to play a mission that allowed them to choose to be a Hero or Villain and complete gameplay in the original games. Going Rogue also granted access to four new power sets, new costume sets and auras, and introduced missions that started after defeating mobs that affected the player''s Alignment.', 'https://www.igdb.com/games/city-of-heroes-going-rogue', '2010-08-01 00:00:00', 20458, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
