(271, 'Medarot 2 Parts Collection', '', 'https://www.igdb.com/games/medarot-2-parts-collection', '1999-10-29 00:00:00', 92535, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(272, 'Dry Drowning', 'Dry Drowning is a psychological investigative visual novel set in a futuristic dystopian city. Follow the story of Mordred Foley, an unscrupulous private detective haunted by his dark past, and look into a series of macabre serial killings inspired by Greek mythology.', 'https://www.igdb.com/games/dry-drowning', '2019-08-02 00:00:00', 119805, NULL);
