(275, 'Rift Sweepers', 'Rift Sweepers is a shooting game based on TPS. In this game, players are going to be a Rift Sweeper to protect the world by travelling between many dimensions. Players can make a team with up to 3 friends. Players should divide their roles in each mission to clear.', 'https://www.igdb.com/games/rift-sweepers', '2022-09-08 00:00:00', 199283, NULL);
