INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(277, 'UniPlex', '', 'https://www.igdb.com/games/uniplex', '2021-03-03 00:00:00', 186705, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(278, 'Arcade Archives: Tecmo Knight', 'Kick the beastman away!', 'https://www.igdb.com/games/arcade-archives-tecmo-knight', '2023-05-02 00:00:00', 248272, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(279, 'Crowalt: Traces of the Lost Colony', 'A young adventurer Hugh Radcliff is in pursuit of one of the greatest mysteries of history: The Lost Colony. Deal with pirates, dive into native rituals, reveal conspiracies, and make tough choices on your difficult journey for unveiling this mystery!', 'https://www.igdb.com/games/crowalt-traces-of-the-lost-colony', '2022-01-06 00:00:00', 132470, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(280, 'Dino Island: The Four Crystals', 'Your main objective is to rescue the crystals stolen by an evil wizard who lives on the island with the dinosaurs, for that the guardian needs to go through stages with challenges and collect crystals.\n\nAt the end of each part of the island the dino will have to face the evil wizard who took the crystals, so if you defeat him he will retrieve a crystal and continue to the next challenge.', 'https://www.igdb.com/games/dino-island-the-four-crystals', '2020-12-31 00:00:00', 194859, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(281, 'Skull Bullets', 'Skull Bullets is a roguelike game with RPG elements. You are a risen from the dead shooter who is trying to get out of the endless forest with the undead. Upgrade your skills, get new weapons and deal with a whole crowd of enemies. Will you be able to get out? It all depends on you.', 'https://www.igdb.com/games/skull-bullets', '2021-10-20 00:00:00', 188859, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(282, 'Minecraft: Bountiful Update', 'Minecraft: Bountiful Update adds 36 new blocks, 4 new mobs, a new underwater dungeon content called the ocean monument and other changes.', 'https://www.igdb.com/games/minecraft-bountiful-update', '2014-09-04 00:00:00', 221873, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(283, 'Adam & Eve', 'Adam & Eve is a Balloon Fight clone made and released by NTDEC in 1991 or 1992.', 'https://www.igdb.com/games/adam-and-eve--1', '1992-12-31 00:00:00', 204500, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(284, 'Cosmonet', '', 'https://www.igdb.com/games/cosmonet', '2018-02-04 00:00:00', 98299, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(285, 'Classic Invaders', 'Classic Invaders is a variant of Space Invaders: accelerated and in colour.\n\nThe game elements and goals are the same as in the original: a lone laser cannon must fend off hordes of alien invaders, who move rhythmically towards the bottom of the screen. As the game progresses, the invading hordes become faster and more aggressive.\n\nThe best scores are stored in the "Killer Kings" high score table.', 'https://www.igdb.com/games/classic-invaders', '1986-12-31 00:00:00', 270765, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(286, 'Make it indie!', 'Claw your way through the abyss of the mind and survive the horrors that stalk you as you attempt to survive seven days as... an Indie Developer.', 'https://www.igdb.com/games/make-it-indie', '2015-04-01 00:00:00', 35541, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(287, 'Tiger Tank 59 I: Mission Pack 021', 'The classic tank battle game re-opens, guarding your base and defeating all indringing enemy tanks. This DLC contains the Chapter 181-185.', 'https://www.igdb.com/games/tiger-tank-59-i-mission-pack-021', '2021-06-05 00:00:00', 155535, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(288, 'Rogue Agent', 'Rogue Agent is a fast-paced strategy and combat game about war between secret agents and spies.', 'https://www.igdb.com/games/rogue-agent', '2018-04-29 00:00:00', 99655, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(289, 'Wheel of Fortune', 'A game based on the Wheel of Fortune TV show for the Game.com.', 'https://www.igdb.com/games/wheel-of-fortune--9', '1997-12-31 00:00:00', 199434, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(290, 'Hearthstone: Rastakhan''s Rumble', 'Rastakhan, king of the Zandalari, ruler of the great troll empire, is calling on trolls from all over Azeroth: come witness the greatest contest of skill, strength, and cunning the world has ever seen. You best bring your finest deck and your boldest plays when you join the rumble. The winner takes all; the loser? Finished.', 'https://www.igdb.com/games/hearthstone-rastakhans-rumble', '2018-12-04 00:00:00', 111655, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(291, 'Spy Alarm', 'Spy Alarm guards your stuff! Spy Alarm works by transmitting an invisible infra-red trip wire which if broken sounds an alarm. Switch between four different alarm sounds and as a bonus Spy Alarm comes equipped with an intruder logger which lets you see exactly when and how many times the alarm was triggered while you were away. So how does it work? Spy alarm transmits an invisible infra-red beam from IR Camera at the bottom of the right Joy-Con, if someone or something crosses the beam, the beams bounces back to the IR Camera which then sounds the alarm. Spy Alarm works better if placed on the edge of a flat surface with a the range of up to 1 metre and even further when a white or reflective object breaks the beam.', 'https://www.igdb.com/games/spy-alarm', '2021-05-27 00:00:00', 148572, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(292, 'Draw', 'Welcome to the world of Draw, a 2D sidescroller and visual novel! Armed with nothing but a pencil, play as "Stickman" as you explore a brand-new world. Solve puzzles by drawing into the game, meet new friends while dodging scribble monsters, and make memories that’ll never be erased!', 'https://www.igdb.com/games/draw', '2023-10-06 00:00:00', 258014, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(293, 'FIFA Soccer 2005', 'Gizmondo port of FIFA Soccer 2005', 'https://www.igdb.com/games/fifa-soccer-2005--2', '2005-09-15 00:00:00', 230476, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(294, 'Rush Hour', 'You are speeding along on a five lane highway during rush hour dodging several obstacles like nails, barricades or destroyed cars. Your mission is to destroy the perpetrators causing traffic jams in blasting them off the street. Collisions of any sort will slow you down and eventually cause your car to break down.\n\nThe game was set for a 1983 release but was ultimately cancelled. In 2003, however, the CGE Services Corp. acquired the rights and released it at the Classic Gaming Expo in 2003.', 'https://www.igdb.com/games/rush-hour', '2003-12-31 00:00:00', 18541, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(295, 'BadLads', 'Massive multiplayer role-play in a giant city. Play on the field as a Police Officer. Rise through the Government to become the most vicious President. Create and lead your very own gang, recruiting new players. Buy yourself the apartment you always deserved, decorate it, and park your new car.', 'https://www.igdb.com/games/badlads', '2020-04-17 00:00:00', 131597, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(296, 'Tiger Tank 59 I: Super Tank MP082', 'Tiger Tank 59 I: Super Tank is a top-down shooting game. Players need to control their tanks, through the enemy lines, break the enemy base, or defeat the enemy tanks. This DLC includes map pack 082.', 'https://www.igdb.com/games/tiger-tank-59-i-super-tank-mp082', '2021-07-19 00:00:00', 160719, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(297, 'SSX 3', 'Gizmondo port of SSX 3', 'https://www.igdb.com/games/ssx-3--2', '2005-08-31 00:00:00', 230477, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(298, 'Spellsworn', 'A unique blend of deck builder card game and a bullet hell!', 'https://www.igdb.com/games/spellsworn--1', '2024-01-31 00:00:00', 289358, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(299, 'Dungeon in Grid Puzzles', 'This is a puzzle game using numbers. There are many monsters on a floor. The distance that the Lady Hilde can move is fixed, and she can only move to the position of an enemy that is weaker than her. And she becomes stronger every time she defeats a monster. Conquer up to 30 underground floors!', 'https://www.igdb.com/games/dungeon-in-grid-puzzles', '2023-04-26 00:00:00', 237244, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(300, 'Pippo''s Quest', 'Pippo''s Quest is a platformer advergame in which your mission is to help Xeleco and his gang find all the Pippos that the wicked evil chicken has stolen.', 'https://www.igdb.com/games/pippos-quest', '2016-10-18 00:00:00', 251584, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(301, 'NHL Hockey', '', 'https://www.igdb.com/games/nhl-hockey--1', '1995-12-31 00:00:00', 210102, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(302, 'Wizard Street', 'Wizard Street is a virtual reality game to fight against dark souls.', 'https://www.igdb.com/games/wizard-street', '2018-01-12 00:00:00', 103004, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(303, 'Rising Angels: Hope', 'Rising Angels: Hope is the visual novel of Faye Moonfallow, her squad of somewhat loveable misfits, and their dreams of joining the Katajion Space Force.', 'https://www.igdb.com/games/rising-angels-hope', '2016-03-18 00:00:00', 35326, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(304, 'City of Heroes', 'City of Heroes was a superhero based MMORPG that ran from April 2004 to November 2012.\n\nIn April 2019, source code capable of running a City of Heroes server was distributed widely. This made it possible to create City of Heroes servers outside the direct purview of NCSoft and revived interest in the game, which by then had been out of development for more than six years.\n\nAs of January 2024, NCSoft has not moved to have servers based on this source code shut down. On January 4, 2024, NCSoft officially granted Homecoming Servers LLC who operated the rogue server Homecoming: City of Heroes an official license to host the game.', 'https://www.igdb.com/games/city-of-heroes', '2004-04-27 00:00:00', 7830, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(305, 'July', 'An adventure game that follows two Japanese kids as they try to solve a mysterious bombing attack.', 'https://www.igdb.com/games/july', '1998-12-31 00:00:00', 62243, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(306, 'Steamroller', 'Repair the potholes in the road. If a beach ball gets in the way, pop it! But beware of beach bombs! You are driving around a continuously deteriorating road, where potholes are forming. You must drive over these potholes to repair them. Along the way, you can drive over beach balls to pop them for points. Don''t let a pothole go too long because if it does, it will become a manhole. If a beach ball falls into a manhole, it will emerge as a beach bomb, that can damage you. In a two player game, knock your opponent into the bombs. In a one player game, avoid the other steamroller as it will kill you except for the last few seconds of the round. In that short time, hitting it will kill it.', 'https://www.igdb.com/games/steamroller', '2000-07-29 00:00:00', 40911, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(307, 'Rust: Console Edition - Ultimate', 'Welcome to Rust.\n\nThose who purchase Rust Console Edition - Ultimate will receive:\nRust Console Edition game\nNew Cobalt Employee - Welcome Pack (Ultimate)\nElite Combat skin pack\n1100 Rust Coins\nPublic Test Branch access', 'https://www.igdb.com/games/rust-console-edition-ultimate', '2021-05-21 00:00:00', 164658, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(308, 'Bushido Bear', 'What’s more dangerous than an angry bear? Or a sword-wielding ninja? A angry, sword-wielding ninja bear of course!\n\nBushido Bear is an original action game by Spry Fox. Defend your forest against endless waves of evil demons by dancing and weaving through your foes with two giant swords! Slice and dice the invaders for as long as you can survive. As you play Bushido Bear, you’ll unlock new ninja characters and upgrade your existing characters, which will change the way you play the game. Lone Cub is slow but can slip past enemies thanks to his tiny size. Smoky Bear can teleport anywhere instantly. Neo Bear slows down time as he plans his attacks. You’ll want to collect and experience all the bears!', 'https://www.igdb.com/games/bushido-bear', '2016-02-26 00:00:00', 58541, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(309, 'Space Seeker', 'Defend your base against enemies.', 'https://www.igdb.com/games/space-seeker', '1981-06-01 00:00:00', 41101, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(310, 'A.S.T.R.A.', 'A.S.T.R.A. - a game made in 2D hand-drawn graphics, which is a collection of various mini-games in different genres. Do you like exciting arcade games, set a new record, and pain in your eyes? Then give this game a try!', 'https://www.igdb.com/games/astra--2', '2021-10-07 00:00:00', 175770, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(311, 'Menghuan Shuiguo Pan: 777 Casino', '', 'https://www.igdb.com/games/menghuan-shuiguo-pan-777-casino', '1993-12-31 00:00:00', 4392, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(312, 'Shower With Your Dad Simulator 2015: Do You Still Shower With Your Dad?', '"Shower With Your Dad Simulator 2015: Do You Still Shower With Your Dad?" is a fast paced shower-simulation where you shower with your 8-bit dad. It''s good, clean fun!', 'https://www.igdb.com/games/shower-with-your-dad-simulator-2015-do-you-still-shower-with-your-dad', '2015-09-02 00:00:00', 12204, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(313, 'Cat Leather Jackets', 'Cat Leather Jackets is a rhythm/visual novel game hybrid about a teenage punk rock band. Follow Priya and her friends as they write, rehearse and perform songs, all the while dealing with the frustrations and drama of being young and trying to figure out what life is all about.', 'https://www.igdb.com/games/cat-leather-jackets', '2023-12-01 00:00:00', 162435, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(314, 'When I Get Home', 'Just what it says. The first game made in Bitsy.', 'https://www.igdb.com/games/when-i-get-home', '2017-08-17 00:00:00', 142541, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(315, 'One Piece: Pirate Warriors - Collector''s Edition', 'Pirate Warriors is an action game incorporating elements from both the Dynasty Warriors series and the One Piece series. The game''s story mode, Main Log, allows the player to play through the storyline. The Adventure mode uses Luffy to play through the events of the One Piece series and the battle mode allows the player to use characters in battles. In Another Log, the player can play through a character''s storyline. With it are several stories exclusive to the game.\n\nIn addition to the game itself, the collector''s edition will exclusively offer the "Thousand Sunny", the ship on which Luffy''s crew sails the seas towards a horizon of adventures.', 'https://www.igdb.com/games/one-piece-pirate-warriors-collectors-edition', '2012-09-21 00:00:00', 225247, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(316, 'Spider-Man 2 Handheld Game', 'Spider-Man 2 Handheld Game is an LCD handheld game based on Spider-Man.', 'https://www.igdb.com/games/spider-man-2-handheld-game', '2004-12-31 00:00:00', 230180, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(317, 'Norimono Banzai!!: Kuruma Daishuugou!!', 'Norimono Banzai!! Kuruma Daishūgō!! (のりものばんざい！！ くるま大集合！！) is a CD-ROM-based educational title for the Playdia console. The title roughly translates to "Vehicles Banzai!! Big Car Set!!"', 'https://www.igdb.com/games/norimono-banzai-kuruma-daishuugou', '1994-12-16 00:00:00', 63957, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(318, 'Penny Arcade: Spider-Man 3: Bell Tower Brawl', 'Penny Arcade: Spider-Man 3: Bell Tower Brawl 3 is an LCD game based on Spider-Man.', 'https://www.igdb.com/games/penny-arcade-spider-man-3-bell-tower-brawl', '2007-12-31 00:00:00', 230181, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(319, 'Baseball', 'Strategy, skill and determination. It takes all three to win at Baseball!', 'https://www.igdb.com/games/baseball--4', '1990-12-31 00:00:00', 85454, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(320, 'Ishidó: The Way of Stones', 'Ishido is a solitaire board game played with tiles, similar to Shanghai. The objective is to place all of the tiles onto the board and obtain the highest possible score by following specific rules of play. There are ways to play that can dramatically increase the score, which makes the game very strategic in nature. Additionally, when desired, the player can get an oracle reading by asking a question, which is answered when the player makes a very elegant play (four-way match).\n\nThe Sega Genesis/Mega Drive port was infamously at the center of the Sega v. Accolade trial of October 31, 1991, Sega filed suit against Accolade in the United States District Court on charges of trademark infringement and unfair competition. Sega argued that Accolade had infringed upon its copyrights because Accolade''s games contained Sega''s material through reverse engineering of Sega''s tech in order to avoid paying license fees. Ultimately, Accolade was ruled in violation on April 3, 1992, when Judge Caulfield ruled in favor of Sega and issued an injunction prohibiting future sales by Accolade of Genesis-compatible games incorporating the Sega message or using the results of the reverse engineering. Almost a week later, Accolade was also required by the court to recall all of their Genesis-compatible games.', 'https://www.igdb.com/games/ishido-the-way-of-stones--2', '1990-02-01 00:00:00', 46206, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(321, 'A Night Walk', 'Take a walk at night and read romantic poetry.', 'https://www.igdb.com/games/a-night-walk', '2018-09-06 00:00:00', 176236, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(322, 'Red Baron', 'Experience the thrill of flying World War I bi- and triplanes. Defend yourself in spectacular aerial dogfights whilst enemies assault you from all sides. Carry out bombing missions, negotiate enemy AAA fire and outwit your opponents with smart tactical moves. Red Baron Pack offers exciting air-to-air and air-to-ground combat in an age when wooden bi-planes and tri-planes ruled the air.', 'https://www.igdb.com/games/red-baron', '1990-01-01 00:00:00', 1934, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(323, 'Grocket', 'Grocket is a minimalist, precision-based adventure and puzzle game. To survive in space, you not only have to escape numerous dangers, but also prove your skills at playing with and against other players.', 'https://www.igdb.com/games/grocket--1', '2022-09-09 00:00:00', 192741, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(324, 'Far Cry 6: Ultimate Edition', 'Welcome to Yara, a tropical paradise frozen in time. Far Cry 6 thrusts players into a modern-day guerrilla revolution. As dictator of Yara, Anton Castillo is intent on restoring his nation back to its former glory by any means, with his son, Diego, following in his bloody footsteps. Become a guerrilla fighter and liberate Yara. Far Cry 6: Ultimate Edition includes the game, the Ultimate Pack and the Season Pass.', 'https://www.igdb.com/games/far-cry-6-ultimate-edition', '2021-10-07 00:00:00', 136404, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(325, 'Deios I: Director''s Cut', 'Deios I is an arena shooter set in a surreal pixel art landscape. Players traverse through strange areas, challenging a series of arenas. Set in an alternative Internet world. The players uncover a mystery of what is the Deios BBS system invented by a strange interfaith cyber author. Themes of God.', 'https://www.igdb.com/games/deios-i-directors-cut', '2022-05-12 00:00:00', 200619, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(326, 'Winter Wonderland', 'The winter holidays are here but when Alexa finds herself alone after her family is stuck when travelling to Paradise Cove, she is forced to go out and try and find some friends in town to spend the holiday with... But something seems strange.. is the day repeating itself?', 'https://www.igdb.com/games/winter-wonderland--2', '2021-10-10 00:00:00', 196059, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(327, 'Find', 'Misha''s brother, Howard, told her a bedtime story... but when she woke up, the girl found herself in a different home, and Howard had disappeared.\n\n"This must be a dream...Brother, where are you?"\n\nDespite investigating the surroundings within that dream, Howard doesn''t seem to be anywhere. And there is also a monster that stalks furiously.\n\nThe monster attacked Misha and suddenly a doll named Luig came to her aid. Luig will help Misha escape from this nightmare and find her lost brother.', 'https://www.igdb.com/games/find', '2017-12-15 00:00:00', 201078, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(328, 'Don''t Stop Corocco 2', 'This is a new entry in the "Don''t Stop Corocco" series of stage-clearing escape games!\nLet''s make a way to proceed the stone Corocco while solving the mystery!\n\nYou don''t need to have played the previous game, "Don''t Stop Corocco" to enjoy this game.', 'https://www.igdb.com/games/dont-stop-corocco-2', '2021-09-27 00:00:00', 206447, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(329, 'SD Gundam Gaiden: Knight Gundam Monogatari 2 - Hikari no Knight', '', 'https://www.igdb.com/games/sd-gundam-gaiden-knight-gundam-monogatari-2-hikari-no-knight--1', '2008-12-15 00:00:00', 206859, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(330, 'Team Fortress 2: Australian Christmas', 'The Australian Christmas was a major content update for Team Fortress 2 and It was the first in what would later become the annual Smissmas event.\n\nA new game mode, Medieval Mode, was introduced with this update. It featured a new map, DeGroot Keep.\n\nThe update also increased default backpack slots from 200 to 300, and added the ability to acquire additional slots (100 at a time) by purchasing the Backpack Expander item. The maximum backpack size became 1000 slots.\n\nAs part of the event, the Festive Winter Crate was added. These were unlockable with a Festive Winter Crate Key, that was only available as a purchase from the Mann Co. Store for $2.49 / £1.99 / €2.49.\n\nThis update also introduced the Itemtest map for the first time.', 'https://www.igdb.com/games/team-fortress-2-australian-christmas', '2010-12-17 00:00:00', 256447, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(331, 'The Lord of the Rings Online: Mines of Moria', 'The Lord of the Rings Online: Mines of Moria is the first retail expansion pack for the MMORPG The Lord of the Rings Online. The storyline is set in Moria, an enormous underground complex in north-western Middle-earth. Apart from that, the expansion also adds the region Lórien. The game''s level cap has been increased to level 60; and the expansion extends the Epic storyline by six more books, and adds two new classes, the Rune-keeper and the Warden. Other new features include environment aware AI, dynamic lighting, and a new weapon enhancement system.', 'https://www.igdb.com/games/the-lord-of-the-rings-online-mines-of-moria', '2008-11-17 00:00:00', 774, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(332, 'Ultra Off-Road Simulator 2019: Alaska', 'Welcome to the ‘Ultimate Off-Road’ experience! All with realistic physics, vehicles and open world - for you to explore. Search for supplies and fuel, repair your car and traverse through wildness of distant Alaska - void of any tracks or roads. Only your map, sense and skills - can lead the way.', 'https://www.igdb.com/games/ultra-off-road-simulator-2019-alaska', '2019-10-25 00:00:00', 113407, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(333, 'Wark & Wimble', 'Eat food, hatch eggs and solve puzzles in this 2D puzzle game. Use the characters to arrange objects while avoiding deadly traps and enemies.', 'https://www.igdb.com/games/wark-and-wimble', '2020-10-19 00:00:00', 151493, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(334, 'Turn Tack', 'A world on the verge of doom, and the girl who holds the key. An exotic puzzle-platformer adventure game based on Aztec myth in South America.', 'https://www.igdb.com/games/turn-tack', '2022-04-28 00:00:00', 197919, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(335, 'The Elephant in Her Room', 'Sometimes a single-minded love can be too heavy. It''s like an elephant. Go through her prejudiced gaze and tell her how attractive you really are.\n\nSokoban with some twists and romance.', 'https://www.igdb.com/games/the-elephant-in-her-room', '2021-07-03 00:00:00', 185182, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(336, 'Hellcoming', 'Hellcoming is a co-op horror survival game for 1-4 players, who need to clean large areas from hellish abomination with the help of special tools.', 'https://www.igdb.com/games/hellcoming', '2021-12-06 00:00:00', 185336, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(337, 'Deus Machina Demonbane', 'Arkham city is a bustling hub of commerce and industry, however Arkham is also a center of eldrich lore: home to Miskatonic University, an institution of higher learning with one of the most complete libraries of arcane literature in the world. In the span of two generations the town was built up to the status of prestige it now commands, an expansion helmed by the Hadou Group, an industrial complex and family dynasty currently run by the young Hadou Ruri. She pursues the peace and prosperity of Arkham diligently, against the forces of darkness threatening to plunge the city, and the world, back into a second dark age. Among the most sinister threats to Arkham City is the evil Black Lodge syndicate. Led by the charismatic Master Therion, his nihilistic outlook shapes the group''s destructive goals: with a circle of powerful sorcerers at his command, the potential for sowing chaos in the city is unmatched.\n\nFormer Miskatonic University Magic Academy student Daijuuji Kurou knows little of grimoires, but what he does know terrifies him - enough that he left his university life behind, and now practices a failing detective business in the shelter of an orphanage in a quiet corner of Arkham. But just when he thought his Academy past was buried, it catches up with him and pulls him back into the dark shadows of the occult: Hadou Ruri herself appears at his door with an offer he can''t refuse. The only way to combat the Black Lodge''s growing magical power is to find, and retrieve, a grimoire with the power to activate the mightiest Machina of all: Demonbane. The quest to find this forbidden tome will change Kurou''s destiny... forever.', 'https://www.igdb.com/games/deus-machina-demonbane', '2003-04-25 00:00:00', 97094, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(338, 'Gachasute! Dino Device 2 - Phoenix', 'Gachasute! Dino Device 2: Phoenix is an Action game, published by Rocket Company, which was released in Japan in 2003.', 'https://www.igdb.com/games/gachasute-dino-device-2-phoenix', '2003-07-12 00:00:00', 49497, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(339, 'Farm 123 - Learn to count', '• Tech With Kids - Best Pick App\n• Winner of the Editor''s Choice Award, Children''s Technology Review\n• iLounge Kids’ App of the Year \n• Winner of the Mom''s Choice Gold Award\n\nOVERVIEW\n• Farm 123 makes learning to count a magical experience. \n• Kids will learn the numbers 1 to ten as they help Farmer Jo around the farm in a series of dazzling fully-interactive scenes as a cow jumps over the moon, pigs make a muddy splash, and eggs hatch in spectacular fashion. \n• They''ll have hours of fun playing with cheeky farm animals: Chasing them, putting them in the pen, and giving them a good wash!\n\nProfessionally designed with toddlers and pre-schoolers in mind, Farm 123 pays special attention to learning reinforcement through the introduction of gently progressive games that help your child cement their grasp of the numbers 1 to 10 and the core concept of sorting.\n\nFEATURES\n• Just like a real book, children can turn the pages and view pop-up scenes from different angles\n• Wonderfully illustrated, with beautiful, pop-up imagery\n• A charming music score and sound effects\n• Children win stars as they progress through the games\n• Professionally narrated in seven languages\n• The full book experience plus two fun counting games are absolutely free\n• Another 5 games can be unlocked with a single, one time low-cost purchase. This feature can be disabled.\n\nGo to storytoys.com to watch a short video of the app.\n\n******************************\n\nSTORYTOYS AWARDS\n• Kidscreen Award\n• Winner of the Bologna Ragazzi Digital Award\n• 11 Children’s Technology Review Editor’s Choice Awards\n• 2 iLounge awards for best kids’ app\n• 2 Mom’s Choice gold awards\n• Mom’s Choice Silver award\n• Shortlist nominations for the FutureBook Digital Innovation Award\n• Best Kids’ App Ever winner\n• Longlisted for the DBW Publishing innovation award\n• 9 Tech With Kids Best Pick App Awards\n\n*************************************************\n\nSTAY IN TOUCH!\nStay in touch to hear about new releases and promotions: \n- Visit us: storytoys.com \n- Need help? For any technical issues please email us at support@storytoys.com \n- Say hello to us on Facebook: facebook.com/StoryToys \n- Tweet us @StoryToys', 'https://www.igdb.com/games/farm-123-learn-to-count', '2012-05-31 00:00:00', 87509, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(340, 'Lycanthorn II: Rain of Beasts', 'Lycanthorn II: Rain of Beasts is a 3d homage to retro classics. Explore an open world and use different characters to explore dungeons and lands full of demons and beasts from legend.\n\nWith First Person melee combat, you''ll dash, dodge and dice around your enemies! Not a fan of melee? Try out the other characters that each have a variety of attacks.', 'https://www.igdb.com/games/lycanthorn-ii-rain-of-beasts', '2020-12-05 00:00:00', 149688, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(341, 'WildStar', 'Critically acclaimed and now Free to Play, WildStar is a fantastical sci-fi MMO where you can join your friends or undertake your own epic adventures on the fabled planet Nexus!\n\nServers for WildStar officially shut down on November 28th 2018.', 'https://www.igdb.com/games/wildstar', '2014-06-03 00:00:00', 535, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(342, 'Nodiatis', 'A classical RPG in an MMO setting, Nodiatis is for gamers who appreciate retro gaming but still want the excitement of competitive play.', 'https://www.igdb.com/games/nodiatis', '2016-11-14 00:00:00', 30966, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(343, 'The Sopranos: Road to Respect', 'The Sopranos: Road to Respect is a 2006 video game based on the HBO series The Sopranos, which aired from January 10, 1999 to June 10, 2007. It was released on November 7, 2006.\nThe game''s storyline takes place between the fifth and sixth seasons and centers on Big Pussy Bonpensiero''s illegitimate son, Joey LaRocca, as he makes his way through the family business.', 'https://www.igdb.com/games/the-sopranos-road-to-respect', '2006-11-07 00:00:00', 17248, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(344, 'My Sister is Wanted', 'A mouse lost in time and the crimes of their family', 'https://www.igdb.com/games/my-sister-is-wanted', '2023-11-06 00:00:00', 276371, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(345, 'AzuFight: Taisen Shiyo', 'AzuFight: Taisen Shiyo is a doujin fighting game based on the Azumanga Daioh anime and manga series. Not to be confused with Azumanga The Fighter T-Style, though possibly meant to serve as a sequel or expansion.', 'https://www.igdb.com/games/azufight-taisen-shiyo', '2005-08-24 00:00:00', 222541, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(346, 'Simple 1500 Series Vol. 77: The Suiei', 'Simple 1500 Series Vol.77: The Suiei is a swimming simulation game that features the classic 4 swimming styles (Freestyle swimming, Breaststroke, Backstroke. & Butterfly stroke), up to four players to compete at the same time, the gameplay controls is using the gamepad analog sticks.', 'https://www.igdb.com/games/simple-1500-series-vol-77-the-suiei', '2001-10-25 00:00:00', 209500, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(347, 'Mooncharmer', 'Inspired by the work of Yiannis Moralis and Moon Mysticism', 'https://www.igdb.com/games/mooncharmer', '2019-12-12 00:00:00', 140078, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(348, 'Kishin Houkou Demonbane', 'Kishin Houkou Demonbane is a remake of Deus Machina Demonbane that makes numerous improvements to the original visual novel, such as full voice acting, lip flaps and blinking for sprites, more animated cutscenes, and a revised script, among other improvements. Unlike the original, this version does not contain any erotic content.', 'https://www.igdb.com/games/kishin-houkou-demonbane', '2004-07-01 00:00:00', 203648, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(349, 'Robocraft Infinity', '', 'https://www.igdb.com/games/robocraft-infinity', '2018-04-11 00:00:00', 93843, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(350, 'Genius Quiz 14', 'Genius Quiz 14 is the fourteenth entry to the trivia game series with brand new fifty questions that challenges your brain.', 'https://www.igdb.com/games/genius-quiz-14', '2017-01-18 00:00:00', 241648, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(351, 'Puzzle Vacations: Christmas', 'Wishing you a season full of light and laughter for you and your family.\nWith tons of challenging puzzles to choose from, stunning scenery to enjoy, you can coddiwomple towards Christmas at your own pace.', 'https://www.igdb.com/games/puzzle-vacations-christmas', '2023-11-04 00:00:00', 275443, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(352, 'Simple 1500 Series Vol. 12: The Quiz', '', 'https://www.igdb.com/games/simple-1500-series-vol-12-the-quiz', '1999-08-12 00:00:00', 209497, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(353, 'Pretzel Pete', '', 'https://www.igdb.com/games/pretzel-pete', '1998-12-31 00:00:00', 209904, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(354, 'Pokémon Cyclone 2', '', 'https://www.igdb.com/games/pokemon-cyclone-2', '1999-12-31 00:00:00', 198851, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(355, 'Parked in the Dark', 'Find you car somewhere in the garage by finding clues, before the time runs out. But you are not as alone as you think...', 'https://www.igdb.com/games/parked-in-the-dark', '2020-09-01 00:00:00', 128281, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(356, 'Genesis Alpha One: Deluxe Edition', 'Hyperjump into the dark recesses of space with Genesis Alpha One Deluxe Edition - where you must build, maintain and navigate your ship through a galaxy filled with hostile alien and human threats. Explore, create and survive the militarized space race in order to secure humanity''s future.', 'https://www.igdb.com/games/genesis-alpha-one-deluxe-edition', '2019-01-29 00:00:00', 154543, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(357, 'Insanity''s Blade', 'Take a father’s journey to hell in order to save the souls of his wife and child. Insanity''s Blade: The Chronicles of Thurstan is the first in a series of games based around the journey of a sword possessed by a father''s powerful grief and hatred. This is the tale of the sword''s creation.', 'https://www.igdb.com/games/insanitys-blade', '2014-12-04 00:00:00', 24559, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(358, 'Ancient Roman: Power of Dark Side', 'A PS1 RPG with 3-D models and pre-rendered backdrops, Ancient Roman was released in 1998 by Nihon System, but exploded into internet infamy in the late 2010s as word of the game began to spread through Japanese gaming circles. It is now widely considered to be one of the worst RPGs ever made by Japanese retro gamers.', 'https://www.igdb.com/games/ancient-roman-power-of-dark-side', '1998-12-31 00:00:00', 193330, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(359, 'Now! That''s What I Call Music: Dance & Sing', 'A dancing and karaoke game based on the compilation record label.', 'https://www.igdb.com/games/now-thats-what-i-call-music-dance-and-sing', '2011-12-02 00:00:00', 56550, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(360, 'Autumn Night 3D Shooter', 'A 3D shooter made in the spirit of the the 90s'' FPSes. Atmospheric pixel graphics, fast-paced action, focus on pure gameplay, made using a software renderer written from scratch.', 'https://www.igdb.com/games/autumn-night-3d-shooter', '2017-05-09 00:00:00', 29723, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(361, 'Wacky Races', 'Game Boy Color Wacky Races game, released to coincide with the release of the Wacky Races game for home consoles and the PC.', 'https://www.igdb.com/games/wacky-races--3', '2000-07-30 00:00:00', 205917, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(362, 'Breath of the Wild Multiplayer', 'An online multiplayer mod for The Legend of Zelda: Breath of the Wild.\nIts development started due to the streamer PointCrow offering U$10,000 for a modder to make an online multiplayer mod for The Legend of Zelda: Breath of the Wild with some conditions, like being the first to stream and that the project needed to be finished before the release of the sequel (Tears of the Kingdom, known as Breath of the Wild 2 at that time).\nBreath of the Wild Multiplayer Team, lead by modder AlexMangue, took on the challenge and released the mod in April 4th, 2023.\nSince then, PointCrow started streaming the mod and recording videos of it, but Nintendo decided to take down his videos. The mod is currently unavailable for download and unsupported, as a prevention from legal actions by Nintendo.', 'https://www.igdb.com/games/breath-of-the-wild-multiplayer', '2023-04-04 00:00:00', 243459, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(363, 'Net Versus Shogi', 'Net Versus Shogi is a game for the Dreamcast.', 'https://www.igdb.com/games/net-versus-shogi', '2001-05-24 00:00:00', 78078, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(364, 'Grabity', 'Dance the tango of death in Grabity, a fast-paced, physics-based arena brawler. Combat robots duke it out using Grab guns to turn nearby objects into lethal projectiles or makeshift shields in intense tactical throw-downs.', 'https://www.igdb.com/games/grabity', '2018-03-31 00:00:00', 75073, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(365, 'Gears', 'Adam and his friends gather for a beer in a bar... After being kidnapped by an assassin... he will have to play a dangerous and deadly game to save his life and that of his friends.', 'https://www.igdb.com/games/gears--1', '2022-08-30 00:00:00', 240078, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(366, 'Billiards Legend: Black 8 Miracle', 'This is the most challenging billiards game. Exquisite graphics quality, Sidespin, masse, jump ball! Enjoy the billiard ball collision!', 'https://www.igdb.com/games/billiards-legend-black-8-miracle', '2021-09-17 00:00:00', 171319, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(367, 'Wander', 'Ever wonder what sort of secrets are hidden amongst nature? Now''s your chance to find out. Soar through the skies, swim the depths of the ocean, and explore the lush rainforests in Wander, the non-combat explorative-based indie MMO. Slow moving and relaxing, with lots of trees and no explosions.', 'https://www.igdb.com/games/wander', '2015-06-04 00:00:00', 10920, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(368, 'Mortadelo y Filemón: La Máquina Meteoroloca', '', 'https://www.igdb.com/games/mortadelo-y-filemon-la-maquina-meteoroloca', '1999-12-31 00:00:00', 138920, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(369, 'Children of Orc', 'Lead your civilization of Orc Children, stranded on a planet. \nBuild infrastructure, explore continents, and instruct your peers. \n \nChildren of Orc mixes the point-and-click adventure game with real-time-strategy. \nYou control one single Orc and will have to instruct your tribe on how to explore and exploit your habitat.', 'https://www.igdb.com/games/children-of-orc', '2016-12-20 00:00:00', 30920, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(370, 'Horror Movie Bingo', 'Prepare to take your scary movie night to the next level of fun with Horror Movie Bingo. See if you can spot enough horror film tropes to get 5-in-a-row!', 'https://www.igdb.com/games/horror-movie-bingo', '2020-10-21 00:00:00', 150537, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(371, 'Phase', 'Rock out to your favorite music in this music and rhythm game from the creators of Guitar Hero and Rock Band. \n \nPhase is played in a forced single-point perspective view of a three line track. Down each line come colored circles, and the player must click the corresponding button on the click wheel when the circle reaches the bottom of the screen. The circles are arranged on the track in relation to the beat of the music track being played. \n \nAdditionally, there are occasional series of smaller, more closely spaced dots that will sweep across the track. These require the player to swipe their finger across the click wheel at the correct pace, instead of clicking the wheel buttons. \n \nThe game comes with Easy, Medium, and Hard settings available for immediate play. After completing a marathon with the Hard difficulty setting, Expert mode is made available. In the same way, completing a marathon on Expert unlocks Insane mode. The difficulty settings control the speed of the track and the number of the dots, as well as their value.', 'https://www.igdb.com/games/phase', '2007-11-06 00:00:00', 72078, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(372, 'Hana Awase: Karakurenai/Utsutsu', 'Volume 3 of Hana Awase.\n\nA maiden''s prayer shall make the flower bloom.\n\nThere is a card game called "Kasen", which is played with cards known as "Hanafuda". Only a handful of people, known as "Kaei", can call on and draw the power of the "flower". With most Kaei are men, the five students who possess the most power within the academy are referred to as the "Gokou" and are revered.\n\nThis is a story about a maiden who has dedicated herself to five male students aiming to become one of the Gokou, set in Kasen National Academy, which is a school that produces many individuals with rare talents.', 'https://www.igdb.com/games/hana-awase-karakurenai-slash-utsutsu', '2015-08-19 00:00:00', 251162, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(373, 'Disney Sports Basketball', '', 'https://www.igdb.com/games/disney-sports-basketball--1', '2002-11-05 00:00:00', 243192, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(374, 'Nox Dei', 'Retro RPG game based on the story of a nun that works for her small community. It''s done with RPG Maker VX ACE within 3 years of work.', 'https://www.igdb.com/games/nox-dei--1', '2017-12-01 00:00:00', 77481, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(375, 'Where the Wild Things Are', 'Where the Wild Things Are is a fun-filled adventure that takes players on a journey through the mysterious island of the Wild Things. Players assume the role of Max, "King of All Wild Things," as they team up with the fearsome but loveable creatures. While journeying across their island, players learn amazing new skills and abilities. Solve action puzzles, overcome challenging obstacles, and play through a unique story narrative to uncover the mystery behind the hostile island and save the Wild Things before it''s too late!', 'https://www.igdb.com/games/where-the-wild-things-are--1', '2009-10-13 00:00:00', 200809, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(376, 'Kartofelka', 'A platformer of medium difficulty where the leading role is played by potato.', 'https://www.igdb.com/games/kartofelka', '2018-01-10 00:00:00', 80982, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(377, 'Detective Riddles: Sherlock''s Heritage 2', 'A unique detective world and new villainous riddles await you! Solve 120 unique griddlers in Detective Riddles 2!', 'https://www.igdb.com/games/detective-riddles-sherlocks-heritage-2', '2021-04-13 00:00:00', 100347, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(378, 'Girls & Dungeons 2', 'Here comes the second (standalone!) installment of the lewd-but-cute dungeon-crawler "Girls and Dungeons"! Featuring all new shenanigans and features; explore new exotic locations, and meet a colorful cast of charming new maidens. Can you stomach spelunking in the cursed booze-dungeon?', 'https://www.igdb.com/games/girls-and-dungeons-2', '2019-08-16 00:00:00', 119635, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(379, 'The BunnyLord Pro Hater Pack', 'The BunnyLord Pro Hater Pack gives you two incredible games from Roll7 in one unique bundle!', 'https://www.igdb.com/games/the-bunnylord-pro-hater-pack', '2016-05-24 00:00:00', 82412, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(380, 'Dewy''s Adventure', 'Save the world as the magical water droplet Dewy with powers of temperature manipulation and particulate matter transition as you fight against the forces of the evil Don Hedron. Or you know, whatever! From Shingo Mukaitoge, creator of Elebits.', 'https://www.igdb.com/games/dewy-s-adventure', '2007-07-26 00:00:00', 4627, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(381, 'The Line', 'Reinventing of 3D puzzles. Experimental gameplay you''ve never seen before.', 'https://www.igdb.com/games/the-line--3', '2020-08-10 00:00:00', 150935, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(382, 'Ultimate Dog Simulator', 'Race into a brand new adventure as a real dog! 10 playable breeds including Dalmatian, German Shepherd, Beagle, Labrador and more! Hunt down food and find your home in a massive realistic world! Survive on the streets of a busy city, battle the local dog catcher, and raise your family as you experience the thrilling life of a dog!\n\nDownload the Ultimate Dog Simulator today while it''s 50% OFF for a very limited time!\n\nBrand New Features\nREALISTIC SIMULATOR\nYou''ll need to maintain your health, hunger, thirst, and energy while exploring city streets and vast forests!\n\nTEN PLAYABLE BREEDS\nChoose from 10 of your favorite breeds of dog in a single game! Become a Labrador, Dalmatian, German Shepherd, French Bulldog, Mastiff, Great Dane, Beagle, Bull Terrier, Rottweiler and Sheepdog! Each breed has their own families, experience, and levels!\n\nDANGEROUS BOSS BATTLES\nTest your skills against SIX thrilling boss battles! A neighborhood foe patrols the streets looking to capture bad dogs! The wild wolves of the forest lurk in the shadows ready to defend their territory!\n\nBUILD YOUR PACK\nDominate other dogs or bring them a treat to recruit them to your family! Customize and play as any dog in your pack and create a powerful family!\n\nRAISE YOUR PUPPIES\nRaise babies that will grow into powerful members of your family! Care for you puppies while they are are young, finding food for them and carrying them in your mouth!\n\nCUSTOMIZE YOUR DOGS\nChoose your animal’s name, appearance, skills, and attributes to complement your pack members and become a more powerful group!\n\nLEVEL UP YOUR DOGS\nGain experience by catching and eating your prey, caring for your family, and completing missions! Level up your dog to increase their health and attack damage, earn points to upgrade your stats, and increase the size of your pack!\n\nEARN STAT POINTS\nStat Points can be used to provide bonus’s to traits like Health, Critical Attack Chance, Run Speed, and much more! \n\nUPGRADEABLE BUFFS\nBuff Points can be used to upgrade your Bark and Growl Buffs, which create temporary Stat Boosting auras around your dog when active! \n\nRAGDOLL PHYSICS\nYour prey now realistically dangles from your jaws as you carry them!\n\nDYNAMIC WEATHER, SEASONS AND DAY/NIGHT CYCLE\nProcedural weather system with unique storms, clouds, sun, stars and changing seasons!\n\nMASSIVE REALISTIC 3D ENVIRONMENT\nExplore a massive world with a wild forest, frosty mountains, a seaside fishing town, peaceful neighborhoods and a busting city!\n\nDOZENS OF ENEMIES\nHunt down animals like squirrels, rabbits, rats, deer, birds, sheep, fish, raccoon, fox, cats, dogs, wolves, bear, owl and many more! Become a house dog and get fed by your owner!\n\nOPTIONAL BLOOD EFFECTS\nIf you are of age or have your parents permission, turn on the BRAND NEW blood effects for added combat ferocity!\n\nGLUTEN-FREE PROMISE\nWith all of our games you will always get the full game with no ads or additional purchases!\n\nDownload the Ultimate Dog Simulator and live the thrilling life of a loyal and powerful dog!\n\nIf you liked living as a Dog then you''ll love our other animal simulators! Download our Ultimate Bird Simulator and live wild and free in the sky, or try the Ultimate Cat Simulator and chase mice through the sewers!\n\nGive us a shout and let us know what you want to play next!\nfacebook.com/glutenfreegames\ntwitter.com/glutenfreegames', 'https://www.igdb.com/games/ultimate-dog-simulator', '2017-10-24 00:00:00', 88941, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(383, 'Automobile Tycoon', 'Car manufacturing company simulator. Turn based, fast paced, covers 100 years of automotive history.', 'https://www.igdb.com/games/automobile-tycoon', '2018-09-04 00:00:00', 43078, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(384, 'LazyTown Live! The Pirate Adventure', 'LazyTown Live! The Pirate Adventure is a video game created for the live theater performance of the same name.', 'https://www.igdb.com/games/lazytown-live-the-pirate-adventure', '2010-12-31 00:00:00', 199039, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(385, 'Harem', 'A sheik in the desert must take odalisques from camels, jeeps and curtains and put them to bed. Various troubles in his way angry servants, nasty monkey and fast pink snakes. Can you complete your harem?', 'https://www.igdb.com/games/harem--1', '1983-03-31 00:00:00', 266649, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(386, 'Another Perspective', 'Another Perspective is a puzzle platformer following the very confusing adventure / slow existential meltdown of someone looking for something that they don''t remember.\n\nThis person(?) has the power to swap minds with what appears to be other versions of himself who all see the world in different ways. Where one pair of eyes sees a bottomless pit, another might not. Where one sees a locked door, another sees a key. To change perspective is to change reality!\n\nCombining these "realities" allows him to progress - or to at least do something that resembles progress - however this new found power leaves him deeply confused. Who is he? Why does he have this super power that doesn''t make any sense? If he''s swapping between bodies which body is really his? Why does he keep having to pick up keys and unlock doors? Where is he going? Is he even going anywhere? Does he even exist? What is he looking for?\n\nThe answers to some, all and none of these questions will be probably definitely not be maybe found by playing the game.', 'https://www.igdb.com/games/another-perspective', '2013-11-08 00:00:00', 9978, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(387, 'Okaeri', 'Okaeri is a Japanese horror game about a middle school girl and her mother who recently moved to a new house. It''s 6:00 pm, coming back home expecting a welcome from your mom, instead, she finds unexpected things happening before her eyes.\nThe game is inspired by short omniverse Japanese horror films.', 'https://www.igdb.com/games/okaeri', '2019-09-04 00:00:00', 122005, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(388, 'Firewatch: Audio Tour', 'This update adds a commentary mode in which the game’s protagonist goes on a hunt for new tapes that contain the developer’s recollections, anecdotes and more. It also adds a free-roam mode.', 'https://www.igdb.com/games/firewatch-audio-tour', '2016-09-21 00:00:00', 251228, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(389, 'Detector Island: A Metal Detecting Game', 'You walk around on an island digging up random bits of metal objects. Most of the time you''ll find trash, but the most rewarding feeling is when you find treasure. These objects earn a varying number of points, depending on what the object comes out as, which you can use to buy skins or upgrades for your detector. Listen to calming music as you take in the island''s unique scenery. What can you dig up?', 'https://www.igdb.com/games/detector-island-a-metal-detecting-game', '2018-07-19 00:00:00', 106005, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(390, 'Kunoichi Botan', 'A role-playing game from Enokippu.', 'https://www.igdb.com/games/kunoichi-botan', '2019-01-04 00:00:00', 82818, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(391, 'Baezult', 'Baezult is a puzzle/action platformer set in a lost temple hidden for thousands of years behind a waterfall. You play as a brave explorer looking to find riches beyond his wildest dreams. But be careful, the people of the temple have protected their wealth very well.', 'https://www.igdb.com/games/baezult', '2016-08-03 00:00:00', 31846, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(392, 'Shinnyuushain Tooru-Kun', 'Shinnyuushain Tooru-Kun is a game for the SG-1000. It was originally an arcade game by Konami known as Mikie outside Japan. \n \nAn unlicensed version was released for the Sega Master System in South Korea.', 'https://www.igdb.com/games/shinnyuushain-tooru-kun', '1985-02-01 00:00:00', 6133, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(393, 'Destiny: The Dark Below', 'Expand your Destiny adventure with a wealth of weapons, armor, and gear earned in new story quests and missions, three new competitive multiplayer arenas, and a new Strike and Raid. Beneath the surface of the Moon, a long-forgotten enemy stirs. Survive the true depths of the Hellmouth, and stop its dark army from invading Earth.', 'https://www.igdb.com/games/destiny-the-dark-below', '2014-12-09 00:00:00', 19920, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(394, 'Moonstuck', 'Relaxing rage game in a cutesy wholesome Moonstuck land. Delicate jump-balancing rage platformer where your job is to escape, while staying relaxed.', 'https://www.igdb.com/games/moonstuck', '2022-04-14 00:00:00', 195152, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(395, 'Chubby Bear Smash', 'Webcam motion control, action-packed and fighting game. Take on the challenge and fight against the bees to finally get your hands on the delicious honey hidden away in the forest.', 'https://www.igdb.com/games/chubby-bear-smash', '2021-06-04 00:00:00', 148302, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(396, 'Professor Watts Memory Match: Puppies', 'Hello Professor Watts here and I have some research to do on memory skills. I have assembled a wide variety of puppies to put our memory to the test. We can see how we''re doing by completing matches in a specific amount of time and earning points to track our overall progress', 'https://www.igdb.com/games/professor-watts-memory-match-puppies', '2018-09-18 00:00:00', 109403, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(397, 'Indiepocalypse #1', 'Issue #1 of a monthly indie game anthology collecting games from 10 developers.', 'https://www.igdb.com/games/indiepocalypse-number-1', '2020-02-20 00:00:00', 240975, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(398, 'Shallow World', 'A "reimagination" of Doom 2 episode 1 (11 maps). + 2 early/reused maps', 'https://www.igdb.com/games/shallow-world', '2022-05-03 00:00:00', 269458, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(399, 'Stygia', 'Play as a ghost, haunt the living, and fight for survival in the land of the dead.', 'https://www.igdb.com/games/stygia', '2012-09-27 00:00:00', 139412, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(400, 'Side to Side', '', 'https://www.igdb.com/games/side-to-side', '2013-12-31 00:00:00', 128569, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(401, 'Coughing Crag', 'A very sick map that was made by Yumheart while they were ill.', 'https://www.igdb.com/games/coughing-crag', '2023-02-02 00:00:00', 269448, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(402, 'Jaws of Destruction', 'Jaws of Destruction is a set of 11 vanilla maps I made in an effort to get better at making easier combat and to mess around with vanilla textures. I''ve aimed for a difficulty curve similar to Scythe, where the first couple of maps are pretty easy but it ramps up near the end. The maps generally take between 5-10 minutes to complete, and are very gameplay-focused. The maps are of various themes - techbases, outdoor valleys, small cities, floating hell fortresses - to name four.', 'https://www.igdb.com/games/jaws-of-destruction', '2022-08-05 00:00:00', 269449, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(403, 'Saikousoku Shikou Shogi Mahjong', 'Saikousoku Shikou Shogi Mahjong is a Miscellaneous game, published by Varie, which was released in Japan in 1995.', 'https://www.igdb.com/games/saikousoku-shikou-shogi-mahjong', '1995-12-31 00:00:00', 37865, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(404, 'Office Elevator', 'Today might be just a regular workday, or you might end up in a complete alternative reality. Office Elevator is a survival horror game with puzzles that takes place in a dark universe.', 'https://www.igdb.com/games/office-elevator', '2022-03-30 00:00:00', 195159, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(405, 'ESC', 'Enter the memories of Raine as she explores the text-based world of VerdaMUCK, a simulation of the old network within the vast cerebrally-interconnected network of the near future. Meanwhile, a mysterious individual known only as The Navigator exposes the truths of the Cerenet as a conspiracy-in-the-making begins to unfold.', 'https://www.igdb.com/games/esc', '2018-03-08 00:00:00', 127884, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(406, 'This Bed We Made', 'This Bed We Made is a third-person mystery game in which you play as a maid in a 1950s hotel and snoop around strangers'' rooms to uncover their deadly secrets. Discover what links the clients together in this tale of love, heartbreak and murder!', 'https://www.igdb.com/games/this-bed-we-made', '2023-11-01 00:00:00', 218674, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(407, 'Nights into Dreams: Pizza Tower', '', 'https://www.igdb.com/games/nights-into-dreams-pizza-tower', '2023-08-06 00:00:00', 265072, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(408, 'The Prophecy Lies!', 'Take the role of Darius, a Tiborean, who has to work with the most despicable creatures of all... the humans! Go to Panom''Arah, a part of the Human World and complete the difficult mission of finding and retrieving the Anomaly, a rare and dangerous form of magic.', 'https://www.igdb.com/games/the-prophecy-lies', '2019-07-05 00:00:00', 120452, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(409, 'Mini Golf Club', 'Mini Golf Club is a realistic mini golf simulator featuring unique game modes, hundreds of holes, an easy-to-use level editor, ball customization and multiplayer.', 'https://www.igdb.com/games/mini-golf-club', '2020-05-29 00:00:00', 130078, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(410, 'Sol Moonarge', 'As earthquakes occurred in the kingdom of Itchy, and demons began roaming freely through the wilderness, the king realized that an ancient prophecy is about to be fulfilled, and the entire world is in danger. The valiant swordsman Soleil lives in the capital city, and the king entrusts him with the task of protecting the two Moon goddesses, and retrieving the Sun Sword, which are necessarily to prevent a magician known as Silver to use the Gears of Fate for his evil purposes...\n\nSol Moonarge is a traditional Japanese-style RPG. As in most games of this genre, the player navigates the main hero and his companions on the top-down "world map", entering towns to buy weapons, armor, and items, as well as hostile locations which are necessary to complete to advance the plot in a linear fashion. Enemy encounters are random; combat is turn-based and viewed from first-person perspective.\n\nAs in most Japanese RPGs, the characters level up automatically, after having accumulated a set amount of experience points; specific weapon and magic proficiencies, however, grow depending on the amount of times player-controlled characters use that particular type of weapon or spell.\n\nThere is a day-night cycle (on the world map only), which influences people''s schedules: at night the shops are closed, but certain characters might appear only during that time.', 'https://www.igdb.com/games/sol-moonarge', '1994-01-07 00:00:00', 85809, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(411, 'Om Nom: Coloring, Toons & Puzzle - Flavorful Puzzles', '', 'https://www.igdb.com/games/om-nom-coloring-toons-and-puzzle-flavorful-puzzles', '2022-03-11 00:00:00', 199828, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(412, 'Exteel', 'Exteel is a (Now cancelled) free-to-play online game centering on mech-on-mech combat between players.', 'https://www.igdb.com/games/exteel--1', '2007-12-04 00:00:00', 77809, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(413, 'Boss Defiance', 'Boss Defiance is an arcade­ action competitive and asymmetric game, with semi­procedural level creation. \nOne player play as the powerful Boss and must fight his way room by room, facing the other 3 players in a battle arena. \nThe Boss will have to survive until the end of the dungeon to succeed.', 'https://www.igdb.com/games/boss-defiance', '2017-09-01 00:00:00', 39924, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(414, 'Aztec Challenge', 'In the Aztec empire you were chosen for sacrifice. \nA forthcoming violent death you can only escape when a risky obstacle course face - the "Aztec Challenge". \nBut that is no picnic: at the beginning it will be from "all sides" . pelted with spears, while one has to work its almost endless way to the temple \n \nOnce there it is not friendly: trapdoors, falling boulders, snakes and spiders waiting for new victims. \n \nit is a moral imperative and a two-player mode - unfortunately alternate the players then only from. \n \nthe game features 7 breathtaking levels (plus end bonus), in which a good reactivity is required. The graph corresponds unfortunately only the ordinary 1984, but does not spoil the good game idea. Moreover, good acoustics for the right mood makes. \n \nIdeal: one has reached a higher level, you do not have to start again when all lives are exhausted.', 'https://www.igdb.com/games/aztec-challenge', '1983-12-31 00:00:00', 13809, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(415, 'Witch''s Bananas', 'Witch''s Bananas is a physics-based platformer where you collect a witch''s lost banana collection by jumping around in during a time limit.', 'https://www.igdb.com/games/witchs-bananas', '2023-10-15 00:00:00', 273720, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(416, 'Spy Escape', 'This is an escape game where you work together with your partner. One will have to be the agent and the other the hacker, and together you will have to solve the problems to get out. One can''t play this game solo, so you have to find a partner online if you want to escape the room.', 'https://www.igdb.com/games/spy-escape', '2021-03-11 00:00:00', 155840, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(417, 'Ravensburger Labyrinth', 'In search of mysterious objects and creatures, players roam the labyrinth as a magician, witch, fortune teller and sorcerer''s apprentice. Whoever finds the way first wins. Luckily, they can use magic to move the walls of the maze. On the way through constantly changing paths, however, each player must first reach secret locations. The mystery cards reveal whether the next target is a ghost, a bunch of keys, an owl or something else. The first to discover all the secrets and return to their starting point is the winner. The random arrangement of the maze cards makes each game different.', 'https://www.igdb.com/games/ravensburger-labyrinth', '2022-04-25 00:00:00', 200049, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(418, 'Nintendo Classic Mini: Family Computer - Weekly Shonen Jump 50th Anniversary Version', 'A special edition of the Nintendo Classic Mini with games from Shonen Jump franchises.', 'https://www.igdb.com/games/nintendo-classic-mini-family-computer-weekly-shonen-jump-50th-anniversary-version', '2018-07-07 00:00:00', 213599, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(419, 'Puzzle Galaxy', 'Play with beautiful varied illustrations, breathtaking photos and special video puzzles playing after completing a particular assembly.', 'https://www.igdb.com/games/puzzle-galaxy', '2022-07-22 00:00:00', 211315, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(420, 'Meteor Crush VR', 'Protect our planet from incoming meteoroids! \n \nUse your VR controllers to crush every one coming your way.', 'https://www.igdb.com/games/meteor-crush-vr', '2016-08-16 00:00:00', 31901, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(421, 'Zone Sega', 'Zone Sega (or Sega Zone) is a plug-in-and-play video game console first released in 2010. The console is built suspiciously like the Wii, having wireless controllers that look similar to television remotes and that respond to movement. It retails at £50 in the UK.\n\nThe Zone Sega is built off a similar console called the "Zone 40" (with 40 games) which in turn was built off the "Zone Wireless Gaming Console" (with 7 games). With the Zone Sega there are 50 built in games, 20 of which are Sega Mega Drive titles, 14 are "arcade games" and 16 are "Interactive Sports games" which make use of the motion control technology.', 'https://www.igdb.com/games/zone-sega', '2010-12-31 00:00:00', 202809, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(422, 'Umbra Fields', 'A Black and White Choose Your Own Adventure game in the Open World of the Umbra Fields. Customize who you are between 13 distinct classes, choose what nation you wish to be in, and explore to your heart''s content. Do quests, explore dungeons, fight, and discover your fate, and the fate of the world.', 'https://www.igdb.com/games/umbra-fields', '2024-12-31 00:00:00', 272571, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(423, 'Beasties', 'Beasties is a lovingly hand-drawn 2D monster trainer game with a turn-based puzzle combat, where you take on the role of a Beastie trainer.', 'https://www.igdb.com/games/beasties', '2022-07-27 00:00:00', 192384, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(424, 'Kickshot', 'Kickshot is a first-person speedrunning game in which you utilize your tools, environment and movement abilities to complete the course as quickly as possible.', 'https://www.igdb.com/games/kickshot', '2018-05-04 00:00:00', 99641, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(425, 'My Heart Grows Fonder', 'Visual novel about a couple who are reunited after a three year separation. Have the two moved on during their time apart? Or will old passions be rekindled?', 'https://www.igdb.com/games/my-heart-grows-fonder', '2019-11-11 00:00:00', 117653, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(426, 'Stronghold: Crusader Extreme', 'Stronghold: Crusader Extreme is an updated version of 2001''s Stronghold expansion, Stronghold: Crusader by Firefly Studios. Crusader Extreme is set in the Middle East during the Crusades era.\n\nStronghold Crusader Extreme has additions of larger armies of 10,000 men, new buildings and missions.\n\nIt also contains an updated version of the original Stronghold Crusader, which includes everything except for outposts, the god powers and the Extreme Crusader Trail. However if the official HD patch is installed, outposts can be built on maps on the original Stronghold Crusader part of Stronghold Crusader Extreme.', 'https://www.igdb.com/games/stronghold-crusader-extreme', '2008-07-02 00:00:00', 9462, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(427, 'Maska', '', 'https://www.igdb.com/games/maska--1', '2023-07-20 00:00:00', 270592, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(428, 'Ore no Ryomi 2', 'Ore no Ryomi 2: The Restaurant is a restaurant management game. Similarly to its predecessor, it''s an action-strategy game where the player must manage his funds and personally prepare all the dishes for the customers.\n\nBefore the start of each day, the player can spend money to purchase expansions for his restaurant, including new food menu items and proper equipment. Once the day starts, the player must manage his time carefully to cater to all the customers and the restaurant''s needs from morning till closing hours.\n\nThroughout the day, new customers keep coming in and ordering food, and events (such as the need to wash dishes or a fire in the kitchen) require the manager''s attention. Each customer and event is represented by a gradually vanishing bar. Preparing food and caring for problems is usually done through a simple, action minigame. The player can only take on one of these at a time, but it is possible to serve prepared meals to customers in the middle of something else.\n\nEach customer expects his food to be prepared strictly according to order. If the player messes something up by adding the wrong ingredients or by under- or overcooking the food, the customer will pay less. And if a customer waits too long without their order being attended to, they get furious and leave, causing a minor monetary penalty. Things get even more hectic during the "Rush Hour" that comes twice daily, during which large crowds of customers keep coming in.\n\nOre no Ryomi 2 also contains several "Challenges": the player, invited to the Iron Chef TV show, tries to complete a specific difficult task, such as preparing many perfect dishes in a limited time. Throughout the game, the player receives trophies and awards, which he can proudly view in his Trophy Room if he has purchased them.', 'https://www.igdb.com/games/ore-no-ryomi-2', '2004-04-18 00:00:00', 240535, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(429, 'Xtreme Air Racing 2', '', 'https://www.igdb.com/games/xtreme-air-racing-2', '2003-10-30 00:00:00', 24110, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(430, 'Accident', 'The course of each accident consists of several stages and possibilities: Providing assistance to accident victims. It is necessary to check the condition of accident victims and help those who need it most. Every accident is different so it is necessary…', 'https://www.igdb.com/games/accident--1', '2022-09-16 00:00:00', 202774, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(431, 'Metro Exodus: Enhanced Edition', 'Metro Exodus is an epic, story-driven first person shooter from 4A Games that blends deadly combat and stealth with exploration and survival horror in one of the most immersive game worlds ever created. Explore the Russian wilderness across vast, non-linear levels and follow a thrilling story-line that spans an entire year through spring, summer and autumn to the depths of nuclear winter. Inspired by the novels of Dmitry Glukhovsky, Metro Exodus continues Artyom’s story in the greatest Metro adventure yet.\n\nEnhanced Edition offers additional Ray Tracing features including Advanced Ray Traced Reflections and support for DLSS 2.0. Additionally, this update improves its existing Ray Traced Global Illumination tech to make every light source fully Ray Traced. It also implements the Ray Traced Emissive Lighting tech from The Two Colonels throughout the game.', 'https://www.igdb.com/games/metro-exodus-enhanced-edition', '2021-06-18 00:00:00', 143292, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(432, 'The Precursors', 'Precursors, predecessors, the legend of galaxy... Who are carrying the forebear''s genes among existing races, we can suppose only...\nWorlds of galaxy are everlasting, beautiful, unique and dangerous. Some of them are inhabited, some ruined and deserted, other - just a smugglers trans-shipment stations.', 'https://www.igdb.com/games/the-precursors', '2009-12-04 00:00:00', 22634, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(433, 'Hell Can Wait', 'Hell Can Wait is a diabolic action-roguelike that combines the furious, fast-paced combat of a bullet-hell shooter with the deep strategy of a deck-building card game. With over 250 cards to unlock, find the perfect combo to send the demon hordes back to Hell!', 'https://www.igdb.com/games/hell-can-wait', '2021-12-31 00:00:00', 133412, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(434, 'Rayman 4 You', 'Relive your experiences in the colorful world of Rayman. Jump around platforms, defeat enemies and most important of all, find Globox!\n\nRayman belongs to Michel Ancel and Ubisoft Montpellier and this game is not made with lucrative intentions. It''s a game for the fans by a huge fan of the Rayman saga.', 'https://www.igdb.com/games/rayman-4-you', '2021-01-02 00:00:00', 178599, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(435, 'Bring Me a Head!', 'Bring Me a Head! is a choice-based text adventure horror game about an executioner. It was a Grand Guignol entry for ECTOCOMP 2016.', 'https://www.igdb.com/games/bring-me-a-head', '2016-10-31 00:00:00', 191412, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(436, 'Cartoon Network: Block Party', 'Cartoon Network Block Party is a party game for Game Boy Advance that enables up to four players to compete "party style" on boards themed to a specific Cartoon Network show, including Johnny Bravo, Ed, Edd ''n Eddy, Courage the Cowardly Dog and Cow and Chicken. It features 14 unique mini-games including: Grand Prix, Strike a Pose, Greased Porkbutts, Backyard Boogie, and Skatin'' the U. Published by Majesco, Cartoon Network Block Party was programmed by John Romero''s Monkeystone development group', 'https://www.igdb.com/games/cartoon-network-block-party', '2004-08-05 00:00:00', 2809, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(437, 'Sherlock Holmes and the Mystery of the Frozen City', 'When a mysterious snowstorm falls on London, so cold that even the Thames is starting to freeze, Sherlock Holmes, the most astute detective of all time, is called in to investigate. Explore amazing environments, meet and interrogate many colorful characters, and examine objects and clues in order to discover the evidence that will help solve this incredible case. Many original puzzles and brain-teasers will put your skills to the test during your investigation, while you unveil the truth behind the Mystery of the Frozen City!', 'https://www.igdb.com/games/sherlock-holmes-and-the-mystery-of-the-frozen-city', '2012-10-26 00:00:00', 47657, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(438, 'Mountain Taxi Driver', 'Taxi driving gets more exciting and adventurous with this brand new game. Act as Taxi driver, find and pick up the passengers and drive through the dangerous and steep hill road terrains and drop the passenger safely at the destinations on time.', 'https://www.igdb.com/games/mountain-taxi-driver', '2019-09-13 00:00:00', 119745, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(439, 'Catching', 'Caching is a game of chase in a restaurant. Be a bully, mess up a restaurant, or be a restaurant manager to stop it. Caching provides multiplayer for up to six people.', 'https://www.igdb.com/games/catching', '2019-05-02 00:00:00', 117654, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(440, 'The Ball Encounter', 'The enemy balls that have many types and powerful skills and they try to attack our base. Our defence tower will automatically launch attack but is not enough to stop the balls, doing the magic skills in a good diverse way is key that could protect our base as a capable defenser.', 'https://www.igdb.com/games/the-ball-encounter', '2018-09-02 00:00:00', 107786, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(441, 'Starters Orders Classic Horse Racing', 'Starters Orders Classic is a new horse racing management game that simulates owning, breeding and racing your own string around the globe. Based on the highly acclaimed Starters Orders 7 simulation engine Starters Orders Classic features a retro 2D race sequence for both flat and jumps racing!', 'https://www.igdb.com/games/starters-orders-classic-horse-racing', '2020-03-07 00:00:00', 131655, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(442, 'Seduction', 'Seduction is a 2D horror adventure game that replies on solving puzzles and escaping dangers. Searched for items that are crucial for puzzles while some are well hidden. Escape from great danger and seek to avoid seduction.', 'https://www.igdb.com/games/seduction--1', '2021-10-09 00:00:00', 172708, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(443, 'Inspector Gadget and the Circus of Fear', 'Inspector Gadget and the Circus of Fear is a video game based on the television show of the same name.', 'https://www.igdb.com/games/inspector-gadget-and-the-circus-of-fear', '1987-12-31 00:00:00', 4860, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(444, 'Immortal Desire', 'Sarah Jane Hamilton, Anna of Gables, is haunted by dark, erotic visions of unspeakable acts, which she struggles to understand. The one constant is a perversely beautiful voodoo ritual that appears in her dreams, and seems to hold the key to her past.', 'https://www.igdb.com/games/immortal-desire', '1994-10-19 00:00:00', 245535, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(445, 'Carrier Trail', 'Deliver a package to the royal family and live to tell the tale! Carrier Trail is an indie, adventure game developed by CrackedGhostGames and inspired by the 1985 game, Oregon Trail.', 'https://www.igdb.com/games/carrier-trail', '2020-07-01 00:00:00', 113901, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(446, 'Shady''s Stone Smash', 'Android-exclusive version of Stone Smash, using assets from Shady''s Poopong and its 20th anniversary version, as well as a few tweaks in gameplay.', 'https://www.igdb.com/games/shadys-stone-smash', '2013-07-12 00:00:00', 63567, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(447, 'Aloha Paradise Hotel', 'Aloha is a free-to-play holiday resort building game in which you create your individual holiday paradise. Be a hotel manager and develop your hotel to be the most popular holiday destination. Chat and play with lots of other players and send tourists to your friend’s hotel.', 'https://www.igdb.com/games/aloha-paradise-hotel', '2017-10-25 00:00:00', 55311, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(448, 'Gunvolt Chronicles: Luminous Avenger iX 2 - Special DLC Boss: Kurona', 'Adds the "VS Kurona" mission to the base mission select menu. Select this mission to go into battle against Kurona from Gal*Gun Double Peace.', 'https://www.igdb.com/games/gunvolt-chronicles-luminous-avenger-ix-2-special-dlc-boss-kurona', '2022-03-24 00:00:00', 199876, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(449, 'Tonka: Dig''n Rigs', 'Tonka Dig''n Rigs is a Tonka PC play set game with a Rig Controls play set for your computer''s keyboard. released on May 2, 2000.', 'https://www.igdb.com/games/tonka-dign-rigs', '2000-05-02 00:00:00', 226412, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(450, 'Dance Dance Revolution', 'Dance Dance Revolution (ダンスダンスレボリューション Dansu Dansu Reboryūshon?), abbreviated DDR and also known as Dancing Stage in earlier games in Europe and Australasia, and some other games in Japan, is a music video game series produced by Konami. Introduced in Japan in 1998 as part of the Bemani series, and released in North America and Europe in 1999, Dance Dance Revolution is the pioneering series of the rhythm and dance genre in video games. Players stand on a "dance platform" or stage and hit colored arrows laid out in a cross with their feet to musical and visual cues. Players are judged by how well they time their dance to the patterns presented to them and are allowed to choose more music to play to if they receive a passing score.\n\nDance Dance Revolution has been given much critical acclaim for its originality and stamina in the video game market. There have been dozens of arcade-based releases across several countries and hundreds of home video game console releases, promoting a music library of original songs produced by Konami''s in-house artists and an eclectic set of licensed music from many different genres. The DDR series has inspired similar games such as Pump It Up by Andamiro and In the Groove by Roxor', 'https://www.igdb.com/games/dance-dance-revolution', '1998-09-26 00:00:00', 3679, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(451, 'FarSky', 'With FarSky, you take the role of Nathan who got lost in the Ocean after the crash of his submarine. You need to learn how to survive in the depths of the Ocean. Use the environment to gather resources, build a base to refill your oxygen and manage all your items, craft equipment and weapons to explore and protect yourself in the Ocean depths, create an in-base farm or go fish hunting to feed yourself,...', 'https://www.igdb.com/games/farsky', '2014-04-25 00:00:00', 17164, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(452, 'Deca', 'It is a horror game, developed inside the psychiatric hospital "Deca" in the year 1960. Inside the same, the protagonist wakes up quite disoriented, bloody, on a stretcher, unable to remember what she does there.', 'https://www.igdb.com/games/deca', '2021-07-16 00:00:00', 113066, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(453, '6 Feet Behind', 'Your pursuer is your only weapon.', 'https://www.igdb.com/games/6-feet-behind', '2021-03-16 00:00:00', 148729, NULL);
INSERT INTO soen_project_phase_1.game(game_id, name, summary, url, release_date, igdb_id, rawg_id) VALUES
(454, 'Narbacular Drop', 'Narbacular Drop is an environmental puzzle video game developed by Nuclear Monkey Software. It was released for free online in 2005 for Microsoft Windows. It was the senior game project of students attending DigiPen Institute of Technology. The gameplay consists of navigating a dungeon using an innovative portal system. The player controls a pair of interconnected portals that can be placed on any non-metallic surface (wall, ceiling, or floor). Gabe Newell, managing director of Valve Corporation, took interest in the team''s work and employed the whole staff at Valve. The developers went on to make Portal (2007) using many of the same concepts.\n\nThe word Narbacular, which does not exist in any dictionary, was chosen primarily to aid in internet search engine results.\n\nBeing mostly a proof of applied concept, the game contains only six puzzles to solve. However, members of the Narbacular Drop forum community have created a catalog of custom maps.', 'https://www.igdb.com/games/narbacular-drop', '2005-05-01 00:00:00', 36809, NULL);
